 ('87', '94', 'no', 'Fannremsgården, Orkdal', NULL, NULL, NULL, 'left', NULL, '<p>Melk, rømme, smør og storfe av historisk omfang på Fannremsgården.<br /></p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Fannremsg\\u00e5rden, Orkdal\",\"seoDescription\":\"Melk, r\\u00f8mme, sm\\u00f8r og\\u00a0storfe\\u00a0av historisk omfang\\u00a0p\\u00e5 Fannremsg\\u00e5rden.\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"92\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Fannremsg\\u00e5rden, Orkdal\",\"seoDescriptionUnparsed\":\"Sm\\u00e5kk\\u00e5 p\\u00e5 historien p\\u00e5 Fannremsg\\u00e5rden.\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, '2017-12-15 12:10:33', '2018-08-15 09:43:32', 'f98c4494-feb0-4832-9641-70e969c9efb8'),
 ('88', '95', 'no', NULL, '<p>Mitt fag og håndverk er egentlig tekstil. Historiske klær, tekstiler og tradisjoner, men melk og smør, det er en stor del av den samme gårdskulturen. Gården er min arv, den har vært i min familie i århundrer.</p>\n<p>- Jon Fredrik Skauge</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2017-12-15 12:10:33', '2018-08-15 09:43:31', '680635e8-bcdf-4cff-97b3-ed1b0d3be16e'),
 ('89', '96', 'no', '41 Z0093', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2017-12-15 12:12:34', '2018-08-15 13:23:00', 'd79c377f-433a-4d5c-b993-9c185b344472'),
 ('90', '97', 'no', NULL, '<p>Credo er en råvare-drevet restaurant som åpnet i Credoveita i Trondheim i 1998. I 2018 flyttet vi til nye lokaler på Lilleby.</p>', 'Kjærlighet til råvaren', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2017-12-15 12:12:59', '2018-08-16 08:00:39', '5b454c95-f7c5-4859-9d11-8ad97522c41f'),
