 ('95', '102', 'no', NULL, '<p>På Credo skal du få mat laget på råvarer dyrket i regionen, fisket i havet utenfor, og meieriprodukter kultivert på måter der smak og bærekraft er viktige elementer.<br /></p>', 'Credos hjerte ligger der råvarene produseres.', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2017-12-15 12:34:47', '2018-08-15 09:58:38', '927c9b8d-ba62-4b17-874f-1a5c0fddb000'),
 ('97', '104', 'no', NULL, '<p>På Credo er vi underordnet den opprinnelig smak, smakene som er stedsbestemt. Vi trenger tilgang på de beste råvarene, og derfor leter vi etter smaker, smaken som kommer fra en gård, en gårdbruker eller et jordsmonn, for det er de små forskjellene som gir de gode råvarene. </p>\n<p>Credo ønsker å ta deg gjennom flerfoldige smaker, teksturer og følelser. Vi ønsker å vise deg gårdene våre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i og til stedet vi er, og dermed er menyen basert på det mest interessante og beste vi får levert, fra dag til dag. </p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2017-12-15 12:34:47', '2018-08-15 09:58:39', '488467dd-66d3-4bef-a537-36ccfdc14acb'),
 ('99', '106', 'no', NULL, '<p>Med nær kontakt til produsentene våre og med en etisk tilnærming til det vi gjør, søker vi kontinuerlig utvikling mot bærekraft, da vi tror på at det gjenspeiler seg i smak. Råvarene er motivasjonen, og med rent håndverk kan vi utfolde oss med en oppmerksomhet rettet utad. Vi tror at enhver komponent er gjeldende - dyrene, skogen, jorden, månen, sjøen og kroppen.</p>\n<p>På Credo feirer vi dette mangfoldet. Vi feirer høydementer, tåke, sol og regn i større og mindre mengder. På Credo feirer vi smaken av stedet. </p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2017-12-15 12:34:47', '2018-08-15 09:58:39', '8d1bd7b7-570d-4b39-a10a-dd51cbc44a9a'),
 ('102', '109', 'no', 'B5 A7193', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2017-12-15 12:37:22', '2018-08-15 13:25:09', '4ee8e850-f2df-4038-b2a3-a3312bf31a1e'),
 ('103', '110', 'no', 'B5 A7794 Bw', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2017-12-15 12:40:14', '2018-08-15 13:25:13', '0e2cae5b-de23-4a5e-a7f2-af3cae22f3eb'),
