 ('137', '144', 'no', NULL, '<p>På midten av 1900-tallet bodde det en nysgjerrig, ujålete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne nærmest, hadde hun en umettelig utfartstrang i verden. <em>Hva trigget henne?</em> Vi tror det var jakten på de rene smakene. Og mat som ingen hun kjente hadde hørt om før. Rettene måtte ha jordnær betydning for å smake det lille ekstra, i følge Jossa. Hun ønsket å forstå seg på verden gjennom mat. Vi er derfor veldig glad og takknemlig for å få fortsette historiene hennes videre, gjennom Jossa mat og drikke her i Credoveita. <br /></p>', 'Jossa', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2017-12-15 15:21:00', '2018-08-15 10:01:19', '12e1e277-db19-4ac4-ba3c-1d4e411ce054'),
 ('138', '145', 'no', NULL, '', 'Vi åpner i starten av 2018, så meld deg på nyhetsbrevet vårt for å motta oppdateringer.', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2017-12-15 15:21:00', '2018-08-15 10:01:19', '9edebf16-7fc4-4bae-9d57-39b8ddd5b09c'),
