 ('146', '153', 'no', NULL, '<p>Innkvartert i Lillebys historiske gamle barnehjem er Finnes Kafe det siste kulinariske tillegget til Heidi Bjerkans voksende spisestue. </p>', 'Finnes Kafé', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2017-12-17 19:27:46', '2018-08-15 10:02:31', 'b36f4eba-629e-435a-9e17-1cae73b3ea55'),
 ('147', '154', 'no', NULL, '<p>En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus på menneskene som maten, bøndene og dyrene, med kjøtt og fisk tilberedt i samme mål, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbrød, andebryst, stekte torskehoder og rabarbraslush.</p>', 'Historien', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2017-12-17 19:27:46', '2018-08-15 10:02:31', '9354d70e-17c0-46ad-a115-b34b62beb70a'),
 ('149', '156', 'no', NULL, '<p>Tekst om Heidi En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus på menneskene som maten, bøndene og dyrene, med kjøtt og fisk tilberedt i samme mål, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbrød, andebryst, stekte torskehoder og rabarbraslush.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2017-12-17 19:27:46', '2018-08-15 10:02:32', 'abaa008a-6dd4-41ad-865d-cf839e4c3ec6'),
