 ('161', '171', 'no', 'Heidi Bjerkan', NULL, NULL, NULL, 'left', NULL, '<p>Heidi Bjerkan er en norsk kokk og kjøkkensjef. I dag driver hun mat-triangelen Credo Restaurant, Jossa mat og drikke og Finnes Kafé på Lilleby, Trondheim.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Heidi Bjerkan\",\"seoDescription\":\"Heidi Bjerkan er en norsk kokk og kj\\u00f8kkensjef. I dag driver hun mat-triangelen Credo Restaurant, Jossa mat og drikke og Finnes Kaf\\u00e9 p\\u00e5 Lilleby, Trondheim.\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"174\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Heidi\",\"seoDescriptionUnparsed\":\"Heidi Bjerkan er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1998.\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 11:28:00', '2018-08-15 09:43:16', 'a2721b91-a4b7-446e-a419-234238b9d7f6'),
 ('162', '172', 'no', NULL, '<p>Heidi vokste opp i Trondheim og i båten til bestefaren på Garten langs Trøndelagskysten. Her knyttet hun sterke bånd til jord og vann, som siden er å se i hennes matlaging.</p>\n<p>Bjerkan sin karriere innenfor kokkeyrket startet allerede som attenåring da hun begynte sin sommerjobb på Østbanekafeen. Der forstod hun raskt at hun ville jobbe med mat. Det høye tempoet et kjøkken innebærer var til stor begeistring for Bjerkan, som er rastløs av natur. </p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 11:28:00', '2018-08-15 09:43:16', 'a531715c-77e3-442e-be2a-2f81ed4ba2bc'),
 ('163', '173', 'no', NULL, NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 11:28:31', '2018-08-16 08:00:39', 'e2810cce-eb9e-4ba2-b212-53b034f1043e'),
