 ('182', '192', 'no', 'Jossa til Sverige', NULL, NULL, NULL, 'left', NULL, '<p>Jossa ser nedover dalen. Hun har vandret i et par dager fra Trondheim. Nå har hun endelig møtt Tobias, en som er kjent i dalen.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa til Sverige\",\"seoDescription\":\"Jossa ser nedover dalen. Hun har vandret i et par dager fra Trondheim.\\u00a0N\\u00e5 har hun endelig m\\u00f8tt Tobias, en som er kjent i dalen.\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"191\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Jossa til Sverige\",\"seoDescriptionUnparsed\":\"Jossa ser nedover dalen. Hun har vandret i et par dager fra Trondheim.\\u00a0N\\u00e5 har hun endelig m\\u00f8tt Tobias, en som er kjent i dalen.\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 14:08:30', '2018-08-15 09:41:52', '93626783-1525-4a15-8dfa-76c64cf3ca9e'),
 ('183', '193', 'no', NULL, '<p>– Jaha du, så du er ute etter den svenske smaken du, sier Tobias på slepent svensk mål.<br />Jossa har spurt og gravd for å finne den som lager den beste maten på denne siden av grensen.</p>\n<p>– Så de sier det ja. Hehe. Tobias ler mens han plukker opp noe som kan virke som en vilkårlig blomst fra bakken.Han smaker og smatter.<br />– At jeg er den du skal snakke med ja.<br />Jossa smiler opprømt, og nikker. <br />– Den kommer herfra. Det er i jorden alt starter, det er der alt opprinner. Så vi må bevege oss litt rundt.</p>\n<p>De fortsetter ferden nedover, mot et forgjettet sted, mot en gård som det går flotte ord om rundt i hele verden.<br />– For at du skal forstå hva de gjør akkurat der, så må vi nesten spise et par ting på veien.</p>\n<p>Tobias lister opp hva Jossa skal smake -Raggmunk med Vesterbotten, Sild med egg, poteter, rug og rødbeter , sild ost og smør, Falukorv, Flesk, rotmos, løk, Fisk med Skagensaus. <br />Dette er veldig kjente smaker, men Raggmunk, det er jeg usikker på.<br />Han ler, mens han henter ut en potet fra sekken. Raggmunk, det er nesten det beste du kan gjøre med poteter.<br />Men kom nå, så spiser vi. Så får du oppskriftenen på alt, som du kan ta med deg hjem igjen.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 14:08:30', '2018-08-15 09:41:52', '60aba918-2518-430c-851b-33c461c24c13'),
