 ('185', '195', 'no', 'Jossa på hjemmebane', NULL, NULL, NULL, 'left', NULL, '<p>Jossa ser utover Ripa på den store båten. Hun tar dype trekk av den friske lufta, helt inn. Det er som om lungene har lengtet etter den kjølige fuktige lufta.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa p\\u00e5 hjemmebane\",\"seoDescription\":\"Jossa ser utover Ripa p\\u00e5 den store b\\u00e5ten. Hun tar dype trekk av den friske lufta, helt inn. Det er som om lungene har lengtet etter den kj\\u00f8lige fuktige\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"194\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Jossa p\\u00e5 hjemmebane\",\"seoDescriptionUnparsed\":\"Jossa ser utover Ripa p\\u00e5 den store b\\u00e5ten. Hun tar dype trekk av den friske lufta, helt inn. Det er som om lungene har lengtet etter den kj\\u00f8lige fuktige\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 14:10:01', '2018-08-15 09:40:35', 'dec9e3cf-5b77-43fb-ab68-93fee0efdea9'),
 ('186', '196', 'no', NULL, '<p>Hun ser havnen i det fjerne, og tusler ned i kahytten.<br />– Hjem. Jeg skal hjem en liten tur, hun smiler til seg selv og tenker på hvordan hun plutselig savnet sild. Og akevitt. </p>\n<p>Det har vært en lang reise siden hun var i Bangkok, eller lille bangkokk da, gjemt inne i chinatown i london. Der hun fikk noen nye smaker, som aldri hadde vært innom Trondheim, før nå. Hun klapper på kofferten som er breddfull av urter, røtter, krydder og oppskrifter hun tar med seg hjem.<br />Men nam prik pao til side, selv om det kanskje er det beste hun hadde smakt, på alt, hun er klar for sild. Og for svinekjøtt. Hun har tenkt mye på hvordan svinekjøttet fra nettopp trøndelag vil passe til alle de thailandske smakene, som et avbrekk fra all julematen. Friskt, sterkt, morsomt.</p>\n<p>Men nå er det rømme som står i hodet. Rømme på vaffel, med løyrom. Og riskrem. Jossa klarer nesten ikke stå stille hun tripper opp og ned dekk mens de legger landgangen klar.</p>\n<p>Hjemme, nærmest roper hun når hun treffer brygga med foten.</p>\n<p>Nå skal det bli godt med gravet fisk.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 14:10:01', '2018-08-15 09:40:35', '44304869-abe8-415e-846f-222d24bfe632'),
