 ('200', '210', 'no', 'Viva Mexico', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 15:49:02', '2018-08-15 13:25:52', '8a715b9e-1adf-4e86-9c6f-f9a4b964909b'),
 ('201', '211', 'no', 'Jossa til Mexico', NULL, NULL, NULL, 'left', NULL, '<p>Etter et lengre opphold på hjemmebane, hvor Jossa har nytt godt av både sild, svinekjøtt og akevitt, pakker Jossa kofferten og sikter mot varmere strøk. Jossa har savnet tropiske frukter, de eksotiske smakene og ikke minst de livlige rytmene – Mexico, watch out! </p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa til Mexico\",\"seoDescription\":\"Etter et lengre opphold p\\u00e5 hjemmebane, hvor Jossa har nytt godt av b\\u00e5de sild, svinekj\\u00f8tt og akevitt, pakker Jossa kofferten og sikter mot varmere str\\u00f8k.\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"210\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Viva Mexico\",\"seoDescriptionUnparsed\":\"Etter et lengre opphold p\\u00e5 hjemmebane, hvor Jossa har nytt godt av b\\u00e5de sild, svinekj\\u00f8tt og akevitt, pakker Jossa kofferten og sikter mot varmere str\\u00f8k.\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceFiel