 ('204', '214', 'no', 'Jossa til Thailand & Laos', NULL, NULL, NULL, 'left', NULL, '<p>Vel tilbake fra Mexico ble ikke lysten på eventyr mettet for Jossa.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa til Thailand & Laos\",\"seoDescription\":\"Vel tilbake fra Mexico ble ikke lysten p\\u00e5 eventyr mettet for Jossa.\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"213\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Jossa p\\u00e5 vei til Thailand & Laos\",\"seoDescriptionUnparsed\":\"Vel tilbake fra Mexico ble ikke lysten p\\u00e5 eventyr mettet for Jossa.\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 15:51:49', '2018-08-15 09:39:21', 'e878825a-3280-4c17-860f-2d8c57a5fae0'),
 ('205', '215', 'no', NULL, '<p>Koffertene er ikke ferdig utpakket før at utstyret pakkes ned igjen og nye reisemål står for tur, for savnet etter de friske urtene, sterke kryddrene og de lekne smakene fører Jossa til big Thailand og Laos! </p>\n<p>Nam prik pao, pad thai og gaeng phed ped yang er bare noen av rettene som står på smaksagendaen for reisen, og Jossa får vann i munnen av tanken.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 15:51:49', '2018-08-15 09:39:21', '71d5a0ab-e866-4a6d-841c-ba7b5dffaeea'),
 ('206', '216', 'no', 'Finnes Gronne Omgivelser', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 15:55:47', '2018-08-15 13:25:32', '8ef3837b-8c40-4db5-a2cc-35703b680001'),
 ('207', '217', 'no', 'Grønne omgivelser ', NULL, NULL, NULL, 'left', NULL, '<p>Vel i hus på Finnes Kafé så blomstrer det for fullt i parsellhagen på Lilleby. <br /></p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Gr\\u00f8nne omgivelser \",\"seoDescription\":\"Vel i hus p\\u00e5 Finnes Kaf\\u00e9 s\\u00e5 blomstrer det for fullt i parsellhagen p\\u00e5 Lilleby.\\u00a0\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"216\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Gr\\u00f8nne omgivelser \",\"seoDescriptionUnparsed\":\"Vel i hus p\\u00e5 Finnes Kaf\\u00e9 s\\u00e5 blomstrer det for fullt i parsellhagen p\\u00e5 Lilleby.\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 15:56:35', '2018-08-15 09:38:46', '7198c92c-98b9-45b9-8f78-67f9e74af6b7'),
 ('208', '218', 'no', NULL, '<p>Friske urter, nydelige blomster og nyttevekster som folk flest bare kan drømme om er lett tilgjengelig like utenfor døra – For en LUKSUS!</p>\n<p>Lilleby Hagelag, i samarbeid med kretsløpsgården Skjølberg Søndre holder hagen i sjakk, og til vår fornøyelse sørger de for friske og grønne omgivelser rundt Finnes Kafé, Jossa mat &amp; drikke og Credo Restaurant.</p>\n<p>Alle som ønsker kan bli med i Lilleby Hagelag, og for mer informasjon, ta kontakt på <a href=\"mailto:post@lillebyhagelag.no\">post@lillebyhagelag.no</a></p>\n<p> \n  </p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 15:56:35', '2018-08-15 09:38:46', 'a82265bc-f0ba-4582-a293-5ca4af7ea097'),
