 ('212', '222', 'no', 'Finnes bakeri', NULL, NULL, NULL, 'left', NULL, '<p>Med bakerovn i hus, lokale mel og kornarter i strisekkene og med god hjelp av Ille Brød Surdeigsbakeri* startet vi opp et lite håndtverksbakeri på Finnes Kafé i September 2017. </p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Finnes bakeri\",\"seoDescription\":\"Med bakerovn i hus, lokale mel og kornarter i strisekkene og med god hjelp av Ille Br\\u00f8d Surdeigsbakeri* startet vi opp et lite h\\u00e5ndtverksbakeri p\\u00e5 Finnes\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"221\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Finnes bakeri\",\"seoDescriptionUnparsed\":\"Med bakerovn i hus, lokale mel og kornarter i strisekkene og med god hjelp av Ille Br\\u00f8d Surdeigsbakeri* startet vi opp et lite h\\u00e5ndtverksbakeri p\\u00e5 Finnes\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 16:00:53', '2018-08-15 09:37:58', 'fe54a911-edb8-4a0e-9801-5d6a473c21a8'),
 ('213', '223', 'no', NULL, '<p>Bakeriet har fokus på naturlig hevet brød – SURDEIGSBRØD – og brødene er utelukkende laget på norsk mel og kornarter. Spelt, Havre, Emmer, og røkt bygg er bare noen alternativer som er å få på kafeen.</p>\n<p> *Ille Brød Surdeigsbakeri (<a href=\"https://www.facebook.com/illebrod/)\">https://www.facebook.com/illebrod/)</a> er et surdeigsbakeri lokalisert i Oslo. De lager naturlig hevet brød og tar utelukkende i bruk lokalt dyrket mel og urkorn. Bakeriet holder til i Lakkegata 53, Oslo, og vi anbefaler hele Oslos befolkning, og alle tilreisende å ta turen innom bakeriet for en smak av byens beste brød!</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 16:00:53', '2018-08-15 09:37:58', '0d118a6f-b1a7-4e2c-a688-2acba0df9d68'),
 ('214', '224', 'no', 'Fossan Brod', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 16:01:57', '2018-08-15 13:25:45', '8799b3de-a3f5-4169-acca-50bd4b37ef51'),
 ('216', '226', 'no', 'Fossan Brød', NULL, NULL, NULL, 'left', NULL, '<p>Fossan Mølle er en perle av mølleverk fra 1936 lokalisert i Skjelstadmarka i Trøndelag. </p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Fossan Br\\u00f8d\",\"seoDescription\":\"Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.\\u00a0\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"224\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Fossan Br\\u00f8d\",\"seoDescriptionUnparsed\":\"Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 16:03:40', '2018-08-15 09:51:29', '6ff3d674-e5ba-471d-9293-9b4a23298d23'),
 ('217', '227', 'no', NULL, '<p>Den ble til da selve turbinen møllen består av, ble fraktet med jernbane til Hegra, og deretter med hest og vogn opp til Skjelstadmarka. I dag driftes Fossan Mølle av Petter Fossan, og matmel blir fortsatt malt i denne gamle mølla. Finnes Kafé ønsker å sette lys på denne gamle perlen, og til vår store begeistring får vi oppdage melet i brødbaksten vår. Vi har utforsket med ulike melsorter fra Fossan Mølle, og eksperimentene har resultert i et eget ”Fossan Brød” som er til salgs i kafeen!</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-01-10 16:03:40', '2018-08-15 09:37:36', '5556681b-f81b-44ae-8893-131a4837e437'),
