 ('418', '275', 'no', NULL, '<p>Det er flere enn få som har ristet på hodet av måten Elin og Carl Erik jobber på. Det er ikke mulig å dyrke de planter dere ønsker her, ikke på den måten dere drømmer om uansett, sier de.\n  Elin og Carl Erik arbeider etter biodynamiske prinsipper, og for dem er jorden alt. Den må være sunn og full av liv. På Skjølberg Søndre hadde ikke jorda vært i drift på femten år, så de har over tid måtte pleie jordsmonnet tilbake til liv.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:05:46', '2018-08-15 09:43:56', '16005329-322c-4f6a-8ba1-ca536f551999'),
 ('419', '276', 'no', NULL, '<p>På Skjølberg Søndre produseres det blant annet rotgrønnsaker, kål og neper av ulike variasjoner, agurker, epleagurker, spiselige vekster og urter. På gården har de også den gamle kurasen \"Sidet Trønder\" og \"Gammel Norsk Spælsau\". Dyrene lever i harmoni med gårdens kretsløpsfilosofi, og er en viktig bidragsyter til gårdens kretsløp.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:05:47', '2018-08-15 09:43:56', 'c2a56d5a-7e2b-4e3f-8092-362859e78755'),
 ('420', '277', 'no', NULL, '<p>Kompostering er også en stor del av kretsløpet til gården, og alle grønnsaksrester fra Credo Restaurant blir omgjort til kompost i fraukjelleren på Skjølberg Søndre. Denne operasjonen er holistisk, og de beholder og gjenbruker så mye som overhodet mulig. I de senere år har de også begynt å dyrke mikrogrønt i jordkjelleren. </p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:05:47', '2018-08-15 09:43:57', '0a9a4660-476c-4750-8d84-c6a1191d07db'),
 ('421', '278', 'no', NULL, '<p>Mangfold, smak, opplevelser og nysgjerrighet for naturens orden er det sentrale i Skjølberg Søndre sitt arbeid, og det å plukke rene, ærlige grønnsaker og urter med egne hender er et høydepunkt for oss som restaurant. Vi setter svært stor pris på kunnskapen som Skjølberg Søndre viser oss om agro-økologisk jordbruk, og sammen pusher vi grensen for hva som er mulig å dyrke på Svorkmo<br /></p>\n<p><a href=\"http://www.skjolbergsondre.no/\">www.skjolbergsondre.no</a>\n  </p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:05:47', '2018-08-15 09:43:57', '4ca17862-c500-45fe-8db6-8bf42a14caa0'),
 ('422', '279', 'no', 'B5 A2735 2', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:09:53', '2018-08-15 13:24:46', 'b152f098-57b4-4522-88a5-3bd4a6475de5'),
 ('423', '279', 'en', 'B5 A2735 2', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:09:53', '2018-08-14 15:09:53', '3532d220-0c0b-4212-afd5-d297b15985c1'),
 ('424', '280', 'no', 'B5 A2318', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:21:31', '2018-08-15 13:24:45', 'e1230db6-8ece-4ade-a0dd-572f8c5ba277'),
