 ('428', '282', 'no', 'B5 A3045', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:27:26', '2018-08-15 13:24:47', 'd284e943-3476-4aa9-acac-69711ee3d3f1'),
 ('429', '282', 'en', 'B5 A3045', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:27:26', '2018-08-14 15:27:26', '8fc2999c-a640-4d24-92b6-4b7ad65e065d'),
 ('430', '283', 'no', NULL, '<p>Jon Fredrik har syv kyr, den samme typen storfe som var vanlig i dette området før den mer produktive NRF (Norsk Rødt Fe) kom som resultat av modernisering. Sidet Trønder er ikke en veldig kjent kurase nå om dagen, men hvis du forestiller deg en ku som er mindre enn en moderne ku, nesten på størrelse med en Grand Danoise, bare kraftigere, er du på rett spor. Disse kyrene, valgt bort tidlig under effektiviseringen av landbruket, produserer ikke den gjennomsnittlige 10.000 liter melk som NRF, de melker mer i de lave tresifrede tallene - men for Jon Fredrik er ikke dette et problem. </p>\n<p>- Det er ikke mengden vi ser etter, sier han med et smil.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:28:34', '2018-08-15 09:43:32', '2d0f494a-5288-4c51-b9ab-32172e6a7472'),
 ('431', '284', 'no', NULL, '<p>Tilbake til smørformen, som et objekt av vellyst, er det plassert på midten av bordet akkurat som noen man tilber. Smør har alltid vært sentrum for oppmerksomheten, og gullfargen er bevis på verdien, verdien av melkefett. I mange år var smør den viktigste (og noen ganger eneste) inntekt for bønder. De solgte smøret og beholdt skummetmelken og kjernemelken til eget bruk. </p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:28:34', '2018-08-15 09:43:32', '832db0c6-0c4d-428f-aa2c-2507a0d61c9b'),
 ('432', '285', 'no', NULL, '<p>Jon Fredrik leverer mesteparten av sin melk til Credo Restaurant, resten bruker han til sine gjester, ettersom Fannremsgården har mange besøkende som er interessert i tradisjonelt håndverk og gårdskultur. Hus, holdt i stand akkurat slik hans besteforeldre hadde det, er fylt opp med flere kulturskatter enn gjennomsnittlig folkemuseum. </p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:28:34', '2018-08-15 09:43:32', '625ff046-0826-46ab-90ca-f9b0d33cb434'),
 ('433', '286', 'no', NULL, '<p>Fannremsgården ligger i Orkanger, i et typisk indre klima. Jorden er basert på sand og moll, perfekte forhold for avlinger og gress. Og været? <br />- Solen skinner alltid, når jeg er hjemme, sier Jon Fredrik. </p>\n<p>I tillegg til \"Sidet Trønderfe\" som produserer melk, og etter etter livets løp, kjøtt, har Jon Fredrik også høner for egg, og hester til fritid. Du kan besøke han for å prøve ut alle hans produkter, og kjøpe tradisjonelle håndverksprodukter i den lille butikken. Smøret alene er verdt turen. Men for å få den aller beste smaken av Jon Fredriks smør, lukk øynene dine og husk potetkaken servert hos oss på Credo. </p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:28:34', '2018-08-15 09:43:32', '029d292c-c037-412e-802a-365dfc189426'),
 ('434', '287', 'no', NULL, '<p>Bjerkan er omtalt som en høyt respektert kokk med en kompromissløs, engasjert og grundig visjon om fruktbart land, råvarenes ubenyttede ressurser og framtidens bonde. </p>\n<p>Bjerkan har alltid vært opptatt av å jobbe bærekraftig, noe som gjenspeiler seg i kvaliteten Credo står for. Med sterk interesse og dedikert ansvar, har Bjerkan i senere tid rekonstruert og utvidet hvordan drive restaurant med et ideal om at næringen kan livsgi lokale bønder i et voksende kommersialisert landbruk. De tette samarbeidene med gårdene Skjølberg Søndre og Fannremsgården er eksempler på hvordan Credo ønsker å bringe de lokale bøndenes håndarbeid fram.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:49:53', '2018-08-15 09:43:16', '3f038009-d99c-4000-9bed-ac34a9283324'),
 ('435', '288', 'no', NULL, '<p>For Heidi er det bøndene som er heltene, og det er produsentene som skal skinne. Gjennom måltidet på Credo tar hun med gjesten på hennes tur gjennom gårdene, sjøen og skogen der råvarene kommer fra.</p>\n<p>Heidi Bjerkan fikk i 2017 både Ingridprisen og Matprisen for sitt engasjement for bedre mat og et bedre landbruk.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 15:49:53', '2018-08-15 09:43:16', '7ecc2583-e195-4947-93bd-6d3848b762d3'),
 ('436', '289', 'no', NULL, '<p>Det viktigste her på Credo er råvarene. Når vi snakker om smak, så tenker vi på muligheten en råvare gir. Hva smaker en gulrot, hva smaker denne gulroten? Hvordan kan vi bruke den, og hvordan endrer smaken seg over tid? Kan den fermenteres, kan den røykes, eller skal vi gjøre begge deler?</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 16:29:49', '2018-08-15 09:58:39', 'fa0e4b2c-0d1b-45ec-8421-8d7ae47bea56'),
 ('439', '291', 'no', 'B5 A8024 2 1', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 16:37:59', '2018-08-15 13:25:21', '98590946-a575-4ec1-8ff3-9ea552a40140'),
 ('440', '291', 'en', 'B5 A8024 2 1', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 16:37:59', '2018-08-14 16:37:59', 'c6daa73d-b340-4294-96a6-09717f2b84c1'),
 ('441', '292', 'no', 'B5 A7853 2', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 16:39:09', '2018-08-15 13:25:18', '52d038ec-6901-44e2-bc08-74ac6a980104'),
 ('442', '292', 'en', 'B5 A7853 2', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 16:39:09', '2018-08-14 16:39:09', 'e921ed01-8f45-483c-89d1-93af87889382'),
 ('443', '293', 'no', 'B5 A1425 2 2 1', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 16:46:58', '2018-08-15 13:23:20', '057af19e-5eba-4e2c-9d7c-fdf60528ddd2'),
 ('444', '293', 'en', 'B5 A1425 2 2 1', NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 16:46:58', '2018-08-14 16:46:58', '0d057c67-5ffe-4134-b4ca-019fcc7e7a22'),
 ('445', '294', 'no', NULL, '<p>På Credo ønsker vi å ta deg gjennom flerfoldige smaker, teksturer og følelser. Vi ønsker å vise deg det beste fra gårdene våre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i, og til stedet vi er på.</p>\n<p>Menyen er satt og består av mellom 20-25 serveringer. Den endres hver eneste dag, da den er basert på det mest interessante og beste vi får levert fra våre leverandører.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 16:48:16', '2018-08-15 09:59:06', '815b997f-ff2b-43bb-9fd0-2f4fd6bdec3f'),
 ('446', '295', 'no', NULL, '<p>Vi setter også sammen en drikkemeny som på beste mulige måte komplementerer og løfter frem hver enkelt rett. Drikkemenyen består av både øl, cider og et utvalg av viner, og også denne endres daglig. Har du spesielle ønsker kan du gjerne bestille fra vår rikholdige vinkjeller bestående av flere tusen viner.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 16:48:16', '2018-08-15 09:59:06', 'c6223ca9-9808-45d9-9824-b889ad86b5e8'),
 ('447', '296', 'no', NULL, '<p>+47 954 37 028<br /><a href=\"mailto:credo@restaurantcredo.no\" class=\"link\">credo@restaurantcredo.no </a></p>\n<p>Ladeveien 9,  7066 Trondheim </p>\n<p>Følg oss på <a href=\"https://www.facebook.com/restaurantcredo.no/\" target=\"_blank\" rel=\"noreferrer noopener\">Facebook </a>og <a href=\"https://www.instagram.com/restaurantcredo/\" target=\"_blank\" rel=\"noreferrer noopener\">Instagram</a></p>', 'Kontakt', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 17:02:04', '2018-08-15 10:00:39', '77e123c8-06b9-401a-854c-710eec8954d7'),
