 ('454', '300', 'no', 'Jossa til Korea', NULL, NULL, NULL, 'left', NULL, '', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa goes to Korea\",\"seoDescription\":\"\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"299\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Jossa til Korea\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 17:45:37', '2018-08-15 22:53:14', 'eb16430d-c9cd-4b1d-8efb-56edbf028826'),
 ('455', '301', 'no', NULL, '<p>Etter en lengre pause fra kjøkkenet og en større mengde norkse tradisjoner som sild, torsk og akevitt etter åpning av et nytt kjøkken på Lilleby, er Jossa sin eventyrlyst tilbake for fullt. </p>\n<p>Sekken har vært pakket og klar i lang tid, og endelig er også Jossa klar til å vende snuten i en retning av mer spicy smaker i Asia og nærmere Korea.</p>\n<p>Vel fremme i Korea, og med kimchi, gochujang, tofu og grillet kjøtt i tankene får Jossa vann i munnen. Men aller først - Spicy Koreansk Ramen! </p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-14 17:45:37', '2018-08-15 22:53:14', 'd1b1bdad-3c55-4ed2-8578-dd08c5105c23'),
