 ('495', '192', 'en', 'Jossa til Sverige', NULL, NULL, NULL, 'left', NULL, '<p>Jossa ser nedover dalen. Hun har vandret i et par dager fra Trondheim. Nå har hun endelig møtt Tobias, en som er kjent i dalen.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa til Sverige\",\"seoDescription\":\"Jossa ser nedover dalen. Hun har vandret i et par dager fra Trondheim.\\u00a0N\\u00e5 har hun endelig m\\u00f8tt Tobias, en som er kjent i dalen.\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"191\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Jossa til Sverige\",\"seoDescriptionUnparsed\":\"Jossa ser nedover dalen. Hun har vandret i et par dager fra Trondheim.\\u00a0N\\u00e5 har hun endelig m\\u00f8tt Tobias, en som er kjent i dalen.\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:34:48', '2018-08-15 09:41:52', '3ea812c4-6acb-4c