 ('496', '195', 'en', 'Jossa på hjemmebane', NULL, NULL, NULL, 'left', NULL, '<p>Jossa ser utover Ripa på den store båten. Hun tar dype trekk av den friske lufta, helt inn. Det er som om lungene har lengtet etter den kjølige fuktige lufta.</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa p\\u00e5 hjemmebane\",\"seoDescription\":\"Jossa ser utover Ripa p\\u00e5 den store b\\u00e5ten. Hun tar dype trekk av den friske lufta, helt inn. Det er som om lungene har lengtet etter den kj\\u00f8lige fuktige\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"194\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Jossa p\\u00e5 hjemmebane\",\"seoDescriptionUnparsed\":\"Jossa ser utover Ripa p\\u00e5 den store b\\u00e5ten. Hun tar dype trekk av den friske lufta, helt inn. Det er som om lungene har lengtet etter den kj\\u00f8lige fuktige\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFie