 ('497', '198', 'en', 'Smak.no om Jossa i Venezuela', NULL, NULL, NULL, 'left', NULL, '<p>Smak.no, Dagens Næringslivs matportal har skrevet en flott<strong> <a href=\"http://www.dn.no/smak/2016/02/17/1409/Restauranter/lag-lammebog-med-sramerikansk-vri\" target=\"_blank\" rel=\"noreferrer noopener\">anmeldelse</a> </strong>av første uken vår i Venezuela med Karlos Ponte. Selv om gjestekokken Ponte er tilbake på hjemmebane i København, kjører Jossa videre med meny fra Venezuela fremover! Les teksten<strong> <a href=\"http://www.dn.no/smak/2016/02/17/1409/Restauranter/lag-lammebog-med-sramerikansk-vri\" target=\"_blank\" rel=\"noreferrer noopener\">her</a>. </strong></p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Smak.no om Jossa i Venezuela\",\"seoDescription\":\"Smak.no, Dagens N\\u00e6ringslivs matportal har skrevet en flott\\u00a0anmeldelse\\u00a0av f\\u00f8rste uken v\\u00e5r i Venezuela med Karlos Ponte. Selv om gjestekokken Ponte er\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"197\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Smak.no om Jossa i Venezuela\",\"seoDescriptionUnparsed\":\"Smak.no, Dagens N\\u00e6ringslivs matportal har skrevet en flott\\u00a0anmeldelse\\u00a0av f\\u00f8rste uken v\\u00e5r i Venezuela med Karlos Ponte. Selv om gjestekokken Ponte er\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:34:48', '2018-08-15 09:44:25', 'ba30f233-37b7-4858-ae59-46ae464c8d95'),
 ('498', '201', 'en', 'Lokalt grogrunnlag', NULL, NULL, NULL, 'left', NULL, '<p>Jossa setter seg opp i stolen, tar en slurk kaffe og tenker på hva hun smakte i går. Det er utvilsomt det beste i Norge sier hun høyt til seg selv. Men hvor går egentlig grensene for smak, og hvem bestemmer hva som er godt og vondt, fortsetter hun mens koppen snart er tom. Med råvarer fra trøndelag, så burde man kunne lag hva som helst, men hvem avgjør hva som er best akkurat her?</p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Lokalt grogrunnlag\",\"seoDescription\":\"Jossa setter seg opp i stolen, tar en slurk kaffe og tenker p\\u00e5 hva hun smakte i g\\u00e5r. Det er utvilsomt det beste i Norge sier hun h\\u00f8yt til seg selv. Men hvor\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"200\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Lokalt grogrunnlag\",\"seoDescriptionUnparsed\":\"Jossa setter seg opp i stolen, tar en slurk kaffe og tenker p\\u00e5 hva hun smakte i g\\u00e5r. Det er utvilsomt det beste i Norge sier hun h\\u00f8yt til seg selv. Men hvor\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:34:48', '2018-08-15 09:40:08', '85f566c4-8741-4c27-99e8-294ee872e252'),
 ('499', '211', 'en', 'Jossa til Mexico', NULL, NULL, NULL, 'left', NULL, '<p>Etter et lengre opphold på hjemmebane, hvor Jossa har nytt godt av både sild, svinekjøtt og akevitt, pakker Jossa kofferten og sikter mot varmere strøk. Jossa har savnet tropiske frukter, de eksotiske smakene og ikke minst de livlige rytmene – Mexico, watch out! </p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa til Mexico\",\"seoDescription\":\"Etter et lengre opphold p\\u00e5 hjemmebane, hvor Jossa har nytt godt av b\\u00e5de sild, svinekj\\u00f8tt og akevitt, pakker Jossa kofferten og sikter mot varmere str\\u00f8k.\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"210\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Viva Mexico\",\"seoDescriptionUnparsed\":\"Etter et lengre opphold p\\u00e5 hjemmebane, hvor Jossa har nytt godt av b\\u00e5de sild, svinekj\\u00f8tt og akevitt, pakker Jossa kofferten og sikter mot varmere str\\u00f8k.\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceFiel