 ('502', '222', 'en', 'Finnes bakeri', NULL, NULL, NULL, 'left', NULL, '<p>Med bakerovn i hus, lokale mel og kornarter i strisekkene og med god hjelp av Ille Brød Surdeigsbakeri* startet vi opp et lite håndtverksbakeri på Finnes Kafé i September 2017. </p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Finnes bakeri\",\"seoDescription\":\"Med bakerovn i hus, lokale mel og kornarter i strisekkene og med god hjelp av Ille Br\\u00f8d Surdeigsbakeri* startet vi opp et lite h\\u00e5ndtverksbakeri p\\u00e5 Finnes\\u2026\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"221\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Finnes bakeri\",\"seoDescriptionUnparsed\":\"Med bakerovn i hus, lokale mel og kornarter i strisekkene og med god hjelp av Ille Br\\u00f8d Surdeigsbakeri* startet vi opp et lite h\\u00e5ndtverksbakeri p\\u00e5 Finnes\\u2026\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel