 ('503', '226', 'en', 'Fossan Brød', NULL, NULL, NULL, 'left', NULL, '<p>Fossan Mølle er en perle av mølleverk fra 1936 lokalisert i Skjelstadmarka i Trøndelag. </p>', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Fossan Br\\u00f8d\",\"seoDescription\":\"Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.\\u00a0\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"224\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Fossan Br\\u00f8d\",\"seoDescriptionUnparsed\":\"Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:34:50', '2018-08-15 09:51:29', '4fdd364c-a09e-47d8-95f2-17f31dfdd055'),
 ('504', '300', 'en', 'Jossa goes to Korea', NULL, NULL, NULL, 'left', NULL, '', '0', '0', '0', '0', '{\"id\":null,\"enabled\":1,\"archived\":0,\"locale\":\"no\",\"localeEnabled\":1,\"slug\":null,\"uri\":null,\"dateCreated\":null,\"dateUpdated\":null,\"root\":null,\"lft\":null,\"rgt\":null,\"level\":null,\"searchScore\":null,\"elementId\":0,\"metaType\":\"template\",\"metaPath\":\"\",\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitle\":\"Jossa goes to Korea\",\"seoDescription\":\"\",\"seoKeywords\":\"\",\"seoImageTransform\":\"\",\"seoFacebookImageTransform\":\"\",\"seoTwitterImageTransform\":\"\",\"twitterCardType\":\"\",\"openGraphType\":\"\",\"robots\":\"\",\"seoImageId\":\"299\",\"seoTwitterImageId\":\"\",\"seoFacebookImageId\":\"\",\"canonicalUrlOverride\":\"\",\"seoTitleUnparsed\":\"Jossa til Korea\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsUnparsed\":\"\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoCommerceVariants\":null,\"__model__\":\"Craft\\\\Seomatic_MetaFieldModel\"}', '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:34:50', '2018-08-15 22:53:14', 'eb31436c-1f2b-4d44-99fe-9038a228e82f'),
 ('505', '301', 'en', NULL, '<p>Etter en lengre pause fra kjøkkenet og en større mengde norkse tradisjoner som sild, torsk og akevitt etter åpning av et nytt kjøkken på Lilleby, er Jossa sin eventyrlyst tilbake for fullt. </p>\n<p>Sekken har vært pakket og klar i lang tid, og endelig er også Jossa klar til å vende snuten i en retning av mer spicy smaker i Asia og nærmere Korea.</p>\n<p>Vel fremme i Korea, og med kimchi, gochujang, tofu og grillet kjøtt i tankene får Jossa vann i munnen. Men aller først - Spicy Koreansk Ramen! </p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:36:23', '2018-08-15 22:53:14', '518481f0-bff6-4c01-af3c-e1755bf43729'),
 ('506', '308', 'en', NULL, '', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:36:23', '2018-08-15 22:53:14', '377c0306-5268-4a36-a28d-fc9464fd4bd3'),
 ('507', '227', 'en', NULL, '<p>Den ble til da selve turbinen møllen består av, ble fraktet med jernbane til Hegra, og deretter med hest og vogn opp til Skjelstadmarka. I dag driftes Fossan Mølle av Petter Fossan, og matmel blir fortsatt malt i denne gamle mølla. Finnes Kafé ønsker å sette lys på denne gamle perlen, og til vår store begeistring får vi oppdage melet i brødbaksten vår. Vi har utforsket med ulike melsorter fra Fossan Mølle, og eksperimentene har resultert i et eget ”Fossan Brød” som er til salgs i kafeen!</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:37:36', '2018-08-15 09:51:29', '59662c52-dc2b-456e-851d-2f796a8cecb5'),
 ('508', '223', 'en', NULL, '<p>Bakeriet har fokus på naturlig hevet brød – SURDEIGSBRØD – og brødene er utelukkende laget på norsk mel og kornarter. Spelt, Havre, Emmer, og røkt bygg er bare noen alternativer som er å få på kafeen.</p>\n<p> *Ille Brød Surdeigsbakeri (<a href=\"https://www.facebook.com/illebrod/)\">https://www.facebook.com/illebrod/)</a> er et surdeigsbakeri lokalisert i Oslo. De lager naturlig hevet brød og tar utelukkende i bruk lokalt dyrket mel og urkorn. Bakeriet holder til i Lakkegata 53, Oslo, og vi anbefaler hele Oslos befolkning, og alle tilreisende å ta turen innom bakeriet for en smak av byens beste brød!</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:37:58', '2018-08-15 09:37:58', 'cfd1fbdc-323e-41b6-b7ca-1c2dd40ce4d0'),
 ('509', '218', 'en', NULL, '<p>Friske urter, nydelige blomster og nyttevekster som folk flest bare kan drømme om er lett tilgjengelig like utenfor døra – For en LUKSUS!</p>\n<p>Lilleby Hagelag, i samarbeid med kretsløpsgården Skjølberg Søndre holder hagen i sjakk, og til vår fornøyelse sørger de for friske og grønne omgivelser rundt Finnes Kafé, Jossa mat &amp; drikke og Credo Restaurant.</p>\n<p>Alle som ønsker kan bli med i Lilleby Hagelag, og for mer informasjon, ta kontakt på <a href=\"mailto:post@lillebyhagelag.no\">post@lillebyhagelag.no</a></p>\n<p> \n  </p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:38:29', '2018-08-15 09:38:46', '87588864-8228-4f60-90df-5d15d7f658cb'),
 ('510', '215', 'en', NULL, '<p>Koffertene er ikke ferdig utpakket før at utstyret pakkes ned igjen og nye reisemål står for tur, for savnet etter de friske urtene, sterke kryddrene og de lekne smakene fører Jossa til big Thailand og Laos! </p>\n<p>Nam prik pao, pad thai og gaeng phed ped yang er bare noen av rettene som står på smaksagendaen for reisen, og Jossa får vann i munnen av tanken.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:39:21', '2018-08-15 09:39:21', '13f3b042-214b-4013-bef0-00e909f54f99'),
 ('511', '196', 'en', NULL, '<p>Hun ser havnen i det fjerne, og tusler ned i kahytten.<br />– Hjem. Jeg skal hjem en liten tur, hun smiler til seg selv og tenker på hvordan hun plutselig savnet sild. Og akevitt. </p>\n<p>Det har vært en lang reise siden hun var i Bangkok, eller lille bangkokk da, gjemt inne i chinatown i london. Der hun fikk noen nye smaker, som aldri hadde vært innom Trondheim, før nå. Hun klapper på kofferten som er breddfull av urter, røtter, krydder og oppskrifter hun tar med seg hjem.<br />Men nam prik pao til side, selv om det kanskje er det beste hun hadde smakt, på alt, hun er klar for sild. Og for svinekjøtt. Hun har tenkt mye på hvordan svinekjøttet fra nettopp trøndelag vil passe til alle de thailandske smakene, som et avbrekk fra all julematen. Friskt, sterkt, morsomt.</p>\n<p>Men nå er det rømme som står i hodet. Rømme på vaffel, med løyrom. Og riskrem. Jossa klarer nesten ikke stå stille hun tripper opp og ned dekk mens de legger landgangen klar.</p>\n<p>Hjemme, nærmest roper hun når hun treffer brygga med foten.</p>\n<p>Nå skal det bli godt med gravet fisk.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:40:35', '2018-08-15 09:40:35', 'f5dba14b-d744-45d9-9c2f-1f50909568fa'),
 ('512', '193', 'en', NULL, '<p>– Jaha du, så du er ute etter den svenske smaken du, sier Tobias på slepent svensk mål.<br />Jossa har spurt og gravd for å finne den som lager den beste maten på denne siden av grensen.</p>\n<p>– Så de sier det ja. Hehe. Tobias ler mens han plukker opp noe som kan virke som en vilkårlig blomst fra bakken.Han smaker og smatter.<br />– At jeg er den du skal snakke med ja.<br />Jossa smiler opprømt, og nikker. <br />– Den kommer herfra. Det er i jorden alt starter, det er der alt opprinner. Så vi må bevege oss litt rundt.</p>\n<p>De fortsetter ferden nedover, mot et forgjettet sted, mot en gård som det går flotte ord om rundt i hele verden.<br />– For at du skal forstå hva de gjør akkurat der, så må vi nesten spise et par ting på veien.</p>\n<p>Tobias lister opp hva Jossa skal smake -Raggmunk med Vesterbotten, Sild med egg, poteter, rug og rødbeter , sild ost og smør, Falukorv, Flesk, rotmos, løk, Fisk med Skagensaus. <br />Dette er veldig kjente smaker, men Raggmunk, det er jeg usikker på.<br />Han ler, mens han henter ut en potet fra sekken. Raggmunk, det er nesten det beste du kan gjøre med poteter.<br />Men kom nå, så spiser vi. Så får du oppskriftenen på alt, som du kan ta med deg hjem igjen.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:41:52', '2018-08-15 09:41:52', '4f0bf65b-18e9-4cf8-a618-06e90c46a0d7'),
 ('513', '190', 'en', NULL, '<p>Tobias har sagt farvel for kort tid siden. Han takket for selskapet, ga henne en god klem og trykket en gave ned i sekken. – Du må ikke åpne den pakken før du er fremme. Tobias så på Jossa og smilte.\n– God tur, og hils til Werner.</p>\n<p>Jossa klatrer om bord i toget og finner kupeen sin. Nattoget til malmø, en behagelig måte å reise på, og fra Malmø er det ikke langt til kontinentet. Hun bryter av skalken på brødet og legger seg på den oppredde senga. Føttene er møre etter all vandringen. Hun forsvinner inn i søvnen samtidig med togets startende bevegelser. Som et barn blir hun dysset i søvn, før hun selv hadde tenkt. Det er mørkt, varmt og behagelig.</p>\n<p>Det spraker i en høyttaler, plinger i en bjelle og det bankes på døren. Det føles som om det er samtidig, men hun tar det på oppvåkingsfasen, at hun har duppet av mellom lydene, bare fortrengt det litt.\nMalmø, den kom raskere enn hun trodde, hele byen ligger der, foran henne, flat som den er.\nHun har børstet av seg smulene fra brødskalken, skiftet, tatt en kattevask og prøvd å legge håret stramt slik det sømmer seg, før hun gikk av toget.</p>\n<p>Båten venter, båten til kontinentet står i havna, noen hundre meter bortenfor stasjonen.\nFra København ble det tog til wien, med bytte i münchen, Jossa var utmattet men merket seg at København var en by hun skulle utforske, men da på vei hjem.</p>\n<p>Brosteinen og kumlokkene, de er fine. Jossa ser ned mens hun tusler ut av stasjonsbygget i Wien.\nMen jeg er sulten. Sier hun høyt til seg selv, så den døsige mannen som sto rett ved siden av i sin egen verden skvetter til og ser på henne.\n– unnskyld, sier han.\nÅh, nei – det var ikke meningen, men jeg er bare litt sulten. Eller hvis jeg skal si det som sant er, jeg er skrubbsulten.\nHun hadde helt glemt å spise, helt glemt at hun var sulten når hun løp fra båt til tog i København, og i München ble det akkurat tid nok til en pølse med sauerkraut.\nHaha! Mannen smiler til, det glimter i gull bakerst i munnen\n– Du har kommet til rett sted. Kom bli med meg.\n-Unnskyld, jeg glemte meg helt bort. Hvor er mine manerer, uff , Werner heter jeg frøken.  Han strekker ut en hånd. Jossa griper den og kjenner det faste håndtrykket. Jossa sier hun, og smiler.</p>\n<p>De nærmest småløper innover byen. Jossa klarer ikke få med seg noe, hun tenker bare på mat.\n– Hva skal du her i Wien ?\n– Jeg skal spise, jeg vil smake det som er østerisk. Det er det som er reisen min skjønner du, jeg vil finne ut av hva ting smaker på forskjellige steder.\nWerner stopper litt, mens han tenker.\n– Så du vil smake det som er mest Wiensk, ok, men da tar vi til høyre her.\nDu skal få Spätzle, og det er best på et bitte lite sted rett her borte.</p>\n<p>De småløper videre, litt uten grunn, men drevet av sult og nysgjerrighet. Spätzle, en slags urpasta, eller gnocchi, eller en blanding av de begge. Når Werner forteller om smaken, den smeltede osten og ikke minst vinen som skal drikkes til går det nesten rundt for Jossa.</p>\n<p>Endelig skal hun få mat.\nWerner dumper ned i stolen ved siden av henne.\n– Sånn, vin og mat på vei. Du er skikkelig sulten ? Jossa klarer knapt å ytre ja, hun venter bare på noe å spise.\n– Jeg bestillte litt forskjellig, så du skal få et raskt overblikk, det blir kanskje litt mye. Men det kommer noen andre venner av meg også, som kan mer om vin, så da spiser han det vi ikke klarer. Ok? Werner har tatt kommandoen og ser ut til å kose seg i rollen som vertskap. – Grillet kalvetunge med syltede grønnsaker, Spätzle med sopp og ost, Gresskarsuppe med krepse-dumplings, Pølse med sauerkraut, Snitzel med potetsalat og sitron, Røye med kål, og til dessert får du Schwartswaldkake med kirsebær også kan du ikke unngå strudelen da. Den må du smake når du er i Wien .\nJossa rister på hodet og ler.\n– Jeg klarer jo ikke alt sammen, det er jo umulig.</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:42:33', '2018-08-15 11:52:58', 'df9a6ef7-95ca-442c-9322-61c011b6ffd7'),
 ('514', '172', 'en', NULL, '<p>Heidi vokste opp i Trondheim og i båten til bestefaren på Garten langs Trøndelagskysten. Her knyttet hun sterke bånd til jord og vann, som siden er å se i hennes matlaging.</p>\n<p>Bjerkan sin karriere innenfor kokkeyrket startet allerede som attenåring da hun begynte sin sommerjobb på Østbanekafeen. Der forstod hun raskt at hun ville jobbe med mat. Det høye tempoet et kjøkken innebærer var til stor begeistring for Bjerkan, som er rastløs av natur. </p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:43:05', '2018-08-15 09:43:16', '333ab84f-a145-47ac-8f25-9280a0243ad8'),
 ('515', '287', 'en', NULL, '<p>Bjerkan er omtalt som en høyt respektert kokk med en kompromissløs, engasjert og grundig visjon om fruktbart land, råvarenes ubenyttede ressurser og framtidens bonde. </p>\n<p>Bjerkan har alltid vært opptatt av å jobbe bærekraftig, noe som gjenspeiler seg i kvaliteten Credo står for. Med sterk interesse og dedikert ansvar, har Bjerkan i senere tid rekonstruert og utvidet hvordan drive restaurant med et ideal om at næringen kan livsgi lokale bønder i et voksende kommersialisert landbruk. De tette samarbeidene med gårdene Skjølberg Søndre og Fannremsgården er eksempler på hvordan Credo ønsker å bringe de lokale bøndenes håndarbeid fram.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:43:05', '2018-08-15 09:43:16', 'bdcd4315-2a50-4acb-85d2-f519f3d1fa83'),
 ('516', '288', 'en', NULL, '<p>For Heidi er det bøndene som er heltene, og det er produsentene som skal skinne. Gjennom måltidet på Credo tar hun med gjesten på hennes tur gjennom gårdene, sjøen og skogen der råvarene kommer fra.</p>\n<p>Heidi Bjerkan fikk i 2017 både Ingridprisen og Matprisen for sitt engasjement for bedre mat og et bedre landbruk.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:43:05', '2018-08-15 09:43:16', '0ac3367b-85cc-4649-ba68-a167733e463b'),
 ('517', '95', 'en', NULL, '<p>Mitt fag og håndverk er egentlig tekstil. Historiske klær, tekstiler og tradisjoner, men melk og smør, det er en stor del av den samme gårdskulturen. Gården er min arv, den har vært i min familie i århundrer.</p>\n<p>- Jon Fredrik Skauge</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:43:31', '2018-08-15 09:43:31', '6164fd43-fc7e-4375-b300-1e4ce01e16a8'),
 ('518', '283', 'en', NULL, '<p>Jon Fredrik har syv kyr, den samme typen storfe som var vanlig i dette området før den mer produktive NRF (Norsk Rødt Fe) kom som resultat av modernisering. Sidet Trønder er ikke en veldig kjent kurase nå om dagen, men hvis du forestiller deg en ku som er mindre enn en moderne ku, nesten på størrelse med en Grand Danoise, bare kraftigere, er du på rett spor. Disse kyrene, valgt bort tidlig under effektiviseringen av landbruket, produserer ikke den gjennomsnittlige 10.000 liter melk som NRF, de melker mer i de lave tresifrede tallene - men for Jon Fredrik er ikke dette et problem. </p>\n<p>- Det er ikke mengden vi ser etter, sier han med et smil.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:43:32', '2018-08-15 09:43:32', '703d86a4-0a13-4027-b8a3-a55d1f5e9ba7'),
 ('519', '284', 'en', NULL, '<p>Tilbake til smørformen, som et objekt av vellyst, er det plassert på midten av bordet akkurat som noen man tilber. Smør har alltid vært sentrum for oppmerksomheten, og gullfargen er bevis på verdien, verdien av melkefett. I mange år var smør den viktigste (og noen ganger eneste) inntekt for bønder. De solgte smøret og beholdt skummetmelken og kjernemelken til eget bruk. </p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:43:32', '2018-08-15 09:43:32', '9dd0b0a6-1e56-4870-9d0f-9c3a7eeeafca'),
 ('520', '285', 'en', NULL, '<p>Jon Fredrik leverer mesteparten av sin melk til Credo Restaurant, resten bruker han til sine gjester, ettersom Fannremsgården har mange besøkende som er interessert i tradisjonelt håndverk og gårdskultur. Hus, holdt i stand akkurat slik hans besteforeldre hadde det, er fylt opp med flere kulturskatter enn gjennomsnittlig folkemuseum. </p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:43:32', '2018-08-15 09:43:32', 'fe57bdfc-f999-4604-aa13-0501fb9f6c2b'),
 ('521', '286', 'en', NULL, '<p>Fannremsgården ligger i Orkanger, i et typisk indre klima. Jorden er basert på sand og moll, perfekte forhold for avlinger og gress. Og været? <br />- Solen skinner alltid, når jeg er hjemme, sier Jon Fredrik. </p>\n<p>I tillegg til \"Sidet Trønderfe\" som produserer melk, og etter etter livets løp, kjøtt, har Jon Fredrik også høner for egg, og hester til fritid. Du kan besøke han for å prøve ut alle hans produkter, og kjøpe tradisjonelle håndverksprodukter i den lille butikken. Smøret alene er verdt turen. Men for å få den aller beste smaken av Jon Fredriks smør, lukk øynene dine og husk potetkaken servert hos oss på Credo. </p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:43:32', '2018-08-15 09:43:32', '150fbb3b-1dd1-46be-98c4-220df85c1d40'),
 ('522', '91', 'en', NULL, '<p>Det er grønt overalt, vanligvis skeptiske og dystre byfolk blir overrasket når de kommer hit og ser alt det som gror i skråningen på Svorkmo.</p>\n<p>Bakken ligger i Orkdal, inntil nå mest kjent for sin elv som deler sitt navn med den største produsenten av bearbeidede matvarer i Norge.\n  </p>\n<p>Grunnen til at dette grønne paradiset finnes er på grunn av Elin og Carl Erik Östlunds utrettelige arbeid og ren viljestyrke.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:43:56', '2018-08-15 09:43:56', '6468b3f5-b269-4a9b-aefa-3d85a2d9e335'),
 ('523', '275', 'en', NULL, '<p>Det er flere enn få som har ristet på hodet av måten Elin og Carl Erik jobber på. Det er ikke mulig å dyrke de planter dere ønsker her, ikke på den måten dere drømmer om uansett, sier de.\n  Elin og Carl Erik arbeider etter biodynamiske prinsipper, og for dem er jorden alt. Den må være sunn og full av liv. På Skjølberg Søndre hadde ikke jorda vært i drift på femten år, så de har over tid måtte pleie jordsmonnet tilbake til liv.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:43:56', '2018-08-15 09:43:56', 'b2681291-d9de-44c4-b485-6ed0b150e9b6'),
 ('524', '276', 'en', NULL, '<p>På Skjølberg Søndre produseres det blant annet rotgrønnsaker, kål og neper av ulike variasjoner, agurker, epleagurker, spiselige vekster og urter. På gården har de også den gamle kurasen \"Sidet Trønder\" og \"Gammel Norsk Spælsau\". Dyrene lever i harmoni med gårdens kretsløpsfilosofi, og er en viktig bidragsyter til gårdens kretsløp.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:43:56', '2018-08-15 09:43:56', '13b52680-4574-4b76-9152-ee1e4b81045f'),
 ('525', '277', 'en', NULL, '<p>Kompostering er også en stor del av kretsløpet til gården, og alle grønnsaksrester fra Credo Restaurant blir omgjort til kompost i fraukjelleren på Skjølberg Søndre. Denne operasjonen er holistisk, og de beholder og gjenbruker så mye som overhodet mulig. I de senere år har de også begynt å dyrke mikrogrønt i jordkjelleren. </p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:43:57', '2018-08-15 09:43:57', 'b5f78ce3-81f7-44b3-8cb1-166f576789c7'),
 ('526', '278', 'en', NULL, '<p>Mangfold, smak, opplevelser og nysgjerrighet for naturens orden er det sentrale i Skjølberg Søndre sitt arbeid, og det å plukke rene, ærlige grønnsaker og urter med egne hender er et høydepunkt for oss som restaurant. Vi setter svært stor pris på kunnskapen som Skjølberg Søndre viser oss om agro-økologisk jordbruk, og sammen pusher vi grensen for hva som er mulig å dyrke på Svorkmo<br /></p>\n<p><a href=\"http://www.skjolbergsondre.no/\">www.skjolbergsondre.no</a>\n  </p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:43:57', '2018-08-15 09:43:57', '08e7d7d7-9a96-45c6-82b2-fc0e7ca959ee'),
 ('527', '84', 'en', NULL, '<p>Credo ønsker å ta deg gjennom flerfoldige smaker, teksturer og følelser. Vi ønsker å vise deg gårdene våre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert på det mest interessante og beste vi får levert, fra dag til dag. Vi setter også sammen en drikkemeny som på beste mulige måte komplementerer og løfter frem hver enkelt rett. Har du spesielle ønsker kan du gjerne bestille fra vår rikholdige vinkjeller bestående av flere tusen viner.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:45:06', '2018-08-15 09:45:19', '3ab40429-648a-47d8-ac96-927d24611b0b'),
 ('528', '85', 'en', NULL, NULL, NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:45:06', '2018-08-15 09:45:19', '593b62be-ae5c-4c7b-8ab2-0990ac41c830'),
 ('529', '86', 'en', NULL, '<p>Credo ønsker å ta deg gjennom flerfoldige smaker, teksturer og følelser. Vi ønsker å vise deg gårdene våre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert på det mest interessante og beste vi får levert, fra dag til dag. Vi setter også sammen en drikkemeny som på beste mulige måte komplementerer og løfter frem hver enkelt rett. Har du spesielle ønsker kan du gjerne bestille fra vår rikholdige vinkjeller bestående av flere tusen viner.</p>', 'En liten mellomtittel', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:45:06', '2018-08-15 09:45:19', 'bc7bebbe-fb24-4851-af16-75d72e017f2a'),
 ('530', '87', 'en', NULL, '<p>Råvarene er motivasjonen vår. Hvorfor skulle vi ellers betale 260 kroner per kilo smør? Med rent håndverk kan vi som kokker utfolde oss med en oppmerksomhet rettet utad, på gjesten som en del av et system. Vi tror at ethvert komponent er gjeldende - dyrene, skogen, jorden, månen, sjøen, kroppen.<br /></p>', 'Vegen videre', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:45:06', '2018-08-15 09:45:19', '925a68d7-ee0d-41e3-b7cd-f247015dda82'),
 ('531', '56', 'en', NULL, '<p>Ramen will be served from 12PM - 8PM, and the price will be 150NOK. No reservation is needed and we are looking forward to welcome you all!</p>', '', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:45:30', '2018-08-15 09:45:30', '3b2f5f47-c1cb-47c4-bfd4-93d187541cab'),
 ('532', '102', 'en', NULL, '<p>På Credo skal du få mat laget på råvarer dyrket i regionen, fisket i havet utenfor, og meieriprodukter kultivert på måter der smak og bærekraft er viktige elementer.<br /></p>', 'Credos hjerte ligger der råvarene produseres.', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:58:38', '2018-08-15 09:58:38', '0306ab68-76d7-4a6a-a3d5-e603d8fa3dae'),
 ('533', '289', 'en', NULL, '<p>Det viktigste her på Credo er råvarene. Når vi snakker om smak, så tenker vi på muligheten en råvare gir. Hva smaker en gulrot, hva smaker denne gulroten? Hvordan kan vi bruke den, og hvordan endrer smaken seg over tid? Kan den fermenteres, kan den røykes, eller skal vi gjøre begge deler?</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:58:39', '2018-08-15 09:58:39', '7ad61d5c-36df-41a8-a787-86703e0f99ac'),
 ('534', '104', 'en', NULL, '<p>På Credo er vi underordnet den opprinnelig smak, smakene som er stedsbestemt. Vi trenger tilgang på de beste råvarene, og derfor leter vi etter smaker, smaken som kommer fra en gård, en gårdbruker eller et jordsmonn, for det er de små forskjellene som gir de gode råvarene. </p>\n<p>Credo ønsker å ta deg gjennom flerfoldige smaker, teksturer og følelser. Vi ønsker å vise deg gårdene våre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i og til stedet vi er, og dermed er menyen basert på det mest interessante og beste vi får levert, fra dag til dag. </p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:58:39', '2018-08-15 09:58:39', '80a80bab-f98b-4393-90aa-9dcb4b6d405a'),
 ('535', '106', 'en', NULL, '<p>Med nær kontakt til produsentene våre og med en etisk tilnærming til det vi gjør, søker vi kontinuerlig utvikling mot bærekraft, da vi tror på at det gjenspeiler seg i smak. Råvarene er motivasjonen, og med rent håndverk kan vi utfolde oss med en oppmerksomhet rettet utad. Vi tror at enhver komponent er gjeldende - dyrene, skogen, jorden, månen, sjøen og kroppen.</p>\n<p>På Credo feirer vi dette mangfoldet. Vi feirer høydementer, tåke, sol og regn i større og mindre mengder. På Credo feirer vi smaken av stedet. </p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:58:39', '2018-08-15 09:58:39', 'e2b720c3-56de-4708-b5c9-b35807b7760c'),
 ('536', '117', 'en', NULL, '<p>Credo meny - 1300,- <br /></p>\n<p>Vinpakke - 1200,-</p>', 'Meny', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:59:06', '2018-08-15 09:59:06', '0d9003d6-fc76-49ff-9aee-a792dba13ee1'),
 ('537', '294', 'en', NULL, '<p>På Credo ønsker vi å ta deg gjennom flerfoldige smaker, teksturer og følelser. Vi ønsker å vise deg det beste fra gårdene våre, fra dyrene deres, fra jorda og fra havet. Vi bruker tid på å finne råvarer som best viser egenskapene til tiden vi er i, og til stedet vi er på.</p>\n<p>Menyen er satt og består av mellom 20-25 serveringer. Den endres hver eneste dag, da den er basert på det mest interessante og beste vi får levert fra våre leverandører.</p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:59:06', '2018-08-15 09:59:06', '4765223c-9b70-4893-ab34-3fd5f7b67cea'),
 ('538', '295', 'en', NULL, '<p>Vi setter også sammen en drikkemeny som på beste mulige måte komplementerer og løfter frem hver enkelt rett. Drikkemenyen består av både øl, cider og et utvalg av viner, og også denne endres daglig. Har du spesielle ønsker kan du gjerne bestille fra vår rikholdige vinkjeller bestående av flere tusen viner.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:59:06', '2018-08-15 09:59:06', 'ce52b079-2740-44cf-aa41-8dfbc79d5116'),
 ('539', '121', 'en', NULL, '<p>Her legger vi ut pressesaker og pressebilder </p>', 'Omtale', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 09:59:43', '2018-08-15 09:59:43', 'b333ef7d-113b-4f94-bc70-f1e3113d5001'),
 ('540', '296', 'en', NULL, '<p>+47 954 37 028<br /><a href=\"mailto:credo@restaurantcredo.no\" class=\"link\">credo@restaurantcredo.no </a></p>\n<p>Ladeveien 9,  7066 Trondheim </p>\n<p>Følg oss på <a href=\"https://www.facebook.com/restaurantcredo.no/\" target=\"_blank\" rel=\"noreferrer noopener\">Facebook </a>og <a href=\"https://www.instagram.com/restaurantcredo/\" target=\"_blank\" rel=\"noreferrer noopener\">Instagram</a></p>', 'Kontakt', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 10:00:39', '2018-08-15 10:00:39', '11c30951-69da-4151-8a10-1f044347757c'),
 ('541', '74', 'en', NULL, '<p>Vi er alltid på utkikk etter nye, engasjerte ansatte som ønsker å bli en del av Credo-familien.</p>\n<p>Hvis du ønsker å søke en stilling eller har noen spørsmål, ta kontakt på: <a href=\"mailto:credo@restaurantcredo.no\" class=\"link\">credo@restaurantcredo.no</a> </p>', 'Karriere', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 10:00:57', '2018-08-15 10:00:57', '40375a89-29f2-4fba-83bf-e6932f6f2a6a'),
 ('542', '144', 'en', NULL, '<p>På midten av 1900-tallet bodde det en nysgjerrig, ujålete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne nærmest, hadde hun en umettelig utfartstrang i verden. <em>Hva trigget henne?</em> Vi tror det var jakten på de rene smakene. Og mat som ingen hun kjente hadde hørt om før. Rettene måtte ha jordnær betydning for å smake det lille ekstra, i følge Jossa. Hun ønsket å forstå seg på verden gjennom mat. Vi er derfor veldig glad og takknemlig for å få fortsette historiene hennes videre, gjennom Jossa mat og drikke her i Credoveita. <br /></p>', 'Jossa', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 10:01:19', '2018-08-15 10:01:19', 'bd79f79d-b416-410c-996c-f06e46763110'),
 ('543', '145', 'en', NULL, '', 'Vi åpner i starten av 2018, så meld deg på nyhetsbrevet vårt for å motta oppdateringer.', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 10:01:19', '2018-08-15 10:01:19', '3d792a9a-5b6c-4b4f-9f5f-9110a39d685e'),
 ('544', '180', 'en', NULL, '<p><a href=\"http://www.restaurantcredo.no/uploads/main/meny_jossa.pdf\">Trykk her for å se meny</a></p>', 'Dagens meny', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 10:01:32', '2018-08-16 08:27:35', '1f0537e4-d5ec-4059-a286-2a1e4e5afbef'),
