 ('549', '185', 'en', NULL, '<p>Vi er alltid på utkikk etter nye, engasjerte ansatte som ønsker å bli en del av Credo-familien. </p>\n<p>Hvis du ønsker å søke en stilling eller har noen spørsmål, ta kontakt på: <a href=\"mailto:credo@restaurantcredo.no\" class=\"link\">credo@restaurantcredo.no</a></p>\n<p><a href=\"mailto:credo@restaurantcredo.no\" class=\"link\"></a></p>', 'Karriere', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 10:02:07', '2018-08-15 10:02:07', '63c6d870-1ac1-47e4-8b8b-ebeb0d686dce'),
