 ('551', '244', 'en', NULL, '<p>+47 954 37 028</p>\n<p><a href=\"mailto:brev@jossamatogdrikke.no\" class=\"link\">brev@jossamatogdrikke.no</a></p>\n<p>Jossa Mat og Drikke<br />Ladeveien 9 <br />7066 Trondheim</p>\n<p>Følg oss på <a href=\"https://www.facebook.com/jossamatogdrikke.no/\" target=\"_blank\" rel=\"noreferrer noopener\">Facebook</a> og <a href=\"https://www.instagram.com/jossamatogdrikke/\" target=\"_blank\" rel=\"noreferrer noopener\">Instagram</a></p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 10:02:20', '2018-08-15 10:02:20', 'f5299ade-d2bf-488c-8e25-e6aa730bd333'),
