 ('557', '156', 'en', NULL, '<p>Tekst om Heidi En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus på menneskene som maten, bøndene og dyrene, med kjøtt og fisk tilberedt i samme mål, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbrød, andebryst, stekte torskehoder og rabarbraslush.</p>', NULL, NULL, 'right', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 10:02:32', '2018-08-15 10:02:32', 'f1d4cb9b-05e4-4ab1-8e19-4be0ff4dfc14'),
 ('558', '161', 'en', NULL, '<p>Navnet på retten — 130,-</p>\n<p>Neste navnet — 150,- </p>', 'Frokost', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 10:02:41', '2018-08-15 10:02:41', '6ef7ec78-fd2c-417d-9873-f85b42c590cf'),
 ('559', '162', 'en', NULL, '<p>Navnet på retten — 130,-</p>\n<p>Neste navnet — 150,-</p>', 'Lunsj', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 10:02:41', '2018-08-15 10:02:41', '2312c717-9dd4-4887-a333-a52c79c86a0a'),
 ('560', '186', 'en', NULL, '<p>Vi er alltid på utkikk etter nye, engasjerte ansatte som ønsker å bli en del av Credo-familien.</p>\n<p>Hvis du ønsker å søke en stilling eller har noen spørsmål, ta kontakt med administrasjonskoordinator: <a href=\"mailto:credo@restaurantcredo.no\" class=\"link\">credo@restaurantcredo.no</a> <a href=\"mailto:career@restaurantcredo.no\" target=\"_blank\" rel=\"noreferrer noopener\"></a></p>', 'Karriere', NULL, 'left', NULL, NULL, '0', '0', '0', '1', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 10:03:12', '2018-08-15 10:03:12', 'b7be8eda-844c-4ef7-9b2d-b205bd082503'),
