 ('562', '247', 'en', NULL, '<p>+47 954 37 028 <br /></p>\n<p>Finnes Kafé<br />Ladeveien 9C<br />7066 Trondheim</p>\n<p>Følg oss på <a href=\"https://www.facebook.com/Finnes-Kaf%C3%A9-700391543494829/\" target=\"_blank\" rel=\"noreferrer noopener\">Facebook</a> og <a href=\"https://www.instagram.com/finneskafe/\" target=\"_blank\" rel=\"noreferrer noopener\">Instagram</a></p>', NULL, NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 10:03:24', '2018-08-15 10:03:24', '463f711b-779c-44cc-b1cd-29d45b17dba0'),
