 ('564', '97', 'en', NULL, '<p>Credo er en råvare-drevet restaurant som åpnet i Credoveita i Trondheim i 1998. I 2018 flyttet vi til nye lokaler på Lilleby.</p>', 'Love for the produce', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 10:15:27', '2018-08-16 08:00:39', 'd98ee19d-4e18-4856-b725-8f3f2ab77e6a'),
 ('565', '80', 'en', NULL, '<p>Credo er en råvare-drevet restaurant som åpnet i Credoveita i Trondheim i 1998. Februar 2018 gjenåpner vi på Lilleby i nye lokaler.  </p>', 'Kjærlighet til råvaren', NULL, 'left', NULL, NULL, '0', '0', '0', '0', NULL, '0', NULL, NULL, NULL, NULL, NULL, '2018-08-15 10:15:27', '2018-08-16 08:00:39', '295450a5-6586-4a40-956e-875fa9daefa7'),
