 ('95', '69', '4', '66', 'no', '2', '', '{\"typeId\":\"4\",\"authorId\":\"59\",\"title\":\"Meny\",\"slug\":\"meny\",\"postDate\":1506234240,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"new1\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"MENY\",\"standardBodyText\":\"<p><br><\\/p>\\r\\n<p>P\\u00e5 Credo \\u00f8nsker vi \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg det beste fra g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i, og til stedet vi er p\\u00e5. Menyen er satt og hver dag er den basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert.&nbsp;<\\/p>\\r\\n<p>Vi setter ogs\\u00e5 sammen en drikkemeny som p\\u00e5 beste mulige m\\u00e5te komplementerer og l\\u00f8fter frem hver enkelt rett. Har du spesielle \\u00f8nsker kan du gjerne bestille fra v\\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<br><\\/p>\"}}}}}', '2017-09-24 06:28:09', '2018-08-08 08:15:07', '963fc250-082a-4748-98ba-72325d395419'),
