 ('97', '17', '4', '66', 'no', '6', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Karriere\",\"slug\":\"kontakt\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardImages\":[\"71\"],\"standardBodyText\":\"\"}},\"73\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"KARRIERE\",\"standardBodyText\":\"<p>Vi er alltid p\\u00e5 utkikk etter nye, engasjerte ansatte som \\u00f8nsker \\u00e5 bli en del av Credo-familien.<br><\\/p>\\r\\n<p>Hvis du \\u00f8nsker \\u00e5 s\\u00f8ke om en stilling eller har noen sp\\u00f8rsm\\u00e5l, ta kontakt med administrasjonskoordinator: career@restaurantcredo.no<\\/p>\\r\\n<p><br><\\/p>\"}}}}}', '2017-09-24 07:02:20', '2018-08-08 08:15:07', 'dbf85582-e161-45b7-a125-0850093f4c5b'),
 ('98', '16', '4', '66', 'no', '2', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Om oss\",\"slug\":\"om-oss\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>( Credo restaurant gjen\\u00e5pner februar 2018 p\\u00e5 Lilleby. )<\\/p>\\r\\n<p>Credos hjerte ligger der r\\u00e5varene produseres. P\\u00e5 Credo skal du f\\u00e5 mat laget p\\u00e5 r\\u00e5varer dyrket i regionen, fisket i havet utenfor, og meieriprodukter kultivert p\\u00e5 m\\u00e5ter der smak og b\\u00e6rekraft er viktige elementer <\\/p>\\r\\n<p>P\\u00e5 Credo bygger vi menyen etter sesongene, etter v\\u00e6ret, etter hum\\u00f8ret og etter hva som m\\u00e5 brukes.<\\/p>\\r\\n<p>Credo restaurant har visjoner om null svinn, om et regenerativt landbruk, om en rikere matjord. <\\/p>\\r\\n<p>Det f\\u00e5r vi til med et tett samspill mellom alle akt\\u00f8rene, og restauranten skal v\\u00e6re et nav, en m\\u00f8teplass for utvikling av ideer og l\\u00f8sninger, til oss som restaurant, men ogs\\u00e5 til produsenter, fiskere og til bryggere. <\\/p>\\r\\n<p>Menyen p\\u00e5 Credo skal gjenspeile tiden og stedet vi er n\\u00e5r den serveres, gjennom ferske og behandlede r\\u00e5varer. <\\/p>\\r\\n\"}}}}}', '2017-12-11 08:12:58', '2018-08-08 08:15:07', '88fecd89-96e9-4550-a932-6e85578c4633'),
