 ('121', '7', '4', '49', 'no', '50', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Credo\",\"slug\":\"restaurant\",\"postDate\":1505469180,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":{\"60\":{\"modified\":\"1\",\"type\":\"introLinks\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Hva er du p\\u00e5 utkikk etter?\",\"customIntroLinks\":{\"61\":{\"type\":\"link\",\"enabled\":\"1\",\"fields\":{\"navn\":\"Book bord\",\"internLink\":[\"55\"],\"externalLink\":\"\"}},\"76\":{\"type\":\"link\",\"enabled\":\"1\",\"fields\":{\"navn\":\"Lese journal\",\"internLink\":\"\",\"externalLink\":\"\"}},\"77\":{\"type\":\"link\",\"enabled\":\"1\",\"fields\":{\"navn\":\"L\\u00e6re om v\\u00e5r filosofi\",\"internLink\":[\"16\"],\"externalLink\":\"\"}}}}},\"80\":{\"modified\":\"1\",\"type\":\"introBoxes\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"82\",\"78\"],\"standardHeading\":\"Kj\\u00e6rlighet til r\\u00e5varen\",\"standardBodyText\":\"<p>Credo er en r\\u00e5vare-drevet restaurant som \\u00e5pnet i Credoveita i Trondheim i 1998. Februar 2018 gjen\\u00e5pner vi p\\u00e5 Lilleby i nye lokaler. &nbsp;<\\/p>\"}},\"62\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"83\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"1\"}},\"97\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Vi tar deg n\\u00e6rt til smaker, teksturer og f\\u00f8lelser. \",\"standardImages\":[\"96\"],\"standardBodyText\":\"<p>Vi \\u00f8nsker \\u00e5 integrere deg og kretsl\\u00f8pene som g\\u00e5rdene v\\u00e5re representerer, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varersom best viser egenskapene til tiden vi er i og til stedet vi er p\\u00e5.<br><\\/p>\"}}}}}', '201