ontinuerlig utvikling mot b\\u00e6rekraft. Vi tror veldig p\\u00e5 at dette gjenspeiler seg i smak. <br><\\/p>\",\"settingImagePosition\":\"left\"}},\"105\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"99\"]}},\"106\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"79\"],\"standardBodyText\":\"<p>R\\u00e5varene er motivasjonen v\\u00e5r. Hvorfor skulle vi ellers betale 260 kroner per kilo sm\\u00f8r? Med rent h\\u00e5ndverk kan vi som kokker utfolde oss med en oppmerksomhet rettet utad, p\\u00e5 gjesten som en del av et system. Vi tror at ethvert komponent er gjeldende - dyrene, skogen, jorden, m\\u00e5nen, sj\\u00f8en, kroppen.<br><\\/p>\\r\\n<p>Vi tar deg n\\u00e6rt til smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 integrere deg og kretsl\\u00f8pene som g\\u00e5rdene v\\u00e5re representerer, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er p\\u00e5.<\\/p>\",\"settingImagePosition\":\"right\"}},\"107\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Heidi\",\"standardImages\":[\"127\"],\"standardBodyText\":\"<p>Heidi Bjerkan (1970) er en norsk kokk, kj\\u00f8kkensjef og medeier. Hun \\u00e5pnet Credo Restaurant i Credoveita, Trondheim i 1997.<\\/p>\"}},\"108\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"101\"],\"standardBodyText\":\"<p>Heidi Bjerkan vokste opp i Trondheim og i b\\u00e5ten til bestefaren p\\u00e5 Garten - tr\\u00f8ndelagskysten. Her knyttet hun sterke b\\u00e5nd til jord og vann, som siden er \\u00e5 se i hennes matlaging. For Heidi Bjerkan er det b\\u00f8ndene som er heltene, og det er produsentene som skal skinne. Gjennom m\\u00e5ltidet p\\u00e5 Credo tar hun med alle gjestene p\\u00e5 hennes tur gjennom g\\u00e5rdene, sj\\u00f8en og skogen der r\\u00e5varene kommer fra.<br><\\/p>\\r\\n<p>Heidi Bjerkan engasjerer seg for mer kunnskap, for bedre landbruk og for st\\u00f8rre interesse for tradisjoner, og Heidi Bjerkan fikk i \\u00e5r Matprisen for sitt engasjement for bedre mat og et bedre landbruk. <\\/p>\",\"settingImagePosition\":\"left\"}},\"111\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"125\"]}},\"112\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Skj\\u00f8lberg S\\u00f8ndre, Svorkmo\",\"standardBodyText\":\"<p>Skj\\u00f8lberg S\\u00f8ndre er en biodynamisk kretsl\\u00f8psg\\u00e5rd som drives av Elin \\u00d6stlund og Carl Erik Skj\\u00f8lberg. Her arbeider de med jordbrukskulturer hvor mangfold, smak, opplevelser og nysgjerrighet for naturens orden er det sentrale. \\u00c5 plukke rene, \\u00e6rlige gr\\u00f8nnsaker og urter med egne hender er et h\\u00f8ydepunkt for oss som kokker, og vi setter sv\\u00e6rt stor pris p\\u00e5 kunnskapen som Skj\\u00f8lberg S\\u00f8ndre viser oss om agro-\\u00f8kologisk jordbruk.<\\/p>\"}},\"113\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"110\"]}},\"114\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Fannremsg\\u00e5rden, Orkdal\",\"standardBodyText\":\"<p>Credo jobber sv\\u00e6rt tett med historiker og g\\u00e5rdbruker Jon Fredrik Skauge. Blant flere r\\u00e5varer henter vi ukentlig nykinnet sm\\u00f8r, fersk melk, r\\u00f8mme og kj\\u00f8tt \\u2013 alt fra g\\u00e5rdens sidete Tr\\u00f8nderfe. De ulike sesongene gir r\\u00e5varer som endrer smak hele tiden, til v\\u00e5r store beg