 ('154', '83', '3', '49', 'no', '4', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Forvandlingen p\\u00e5 Lilleby \",\"slug\":\"vi-gjenapner-pa-lilleby\",\"postDate\":1513339080,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"4\",\"5\",\"6\"],\"4\":[\"81\"],\"10\":\"<p>Credo er en r\\u00e5vare-drevet restaurant som \\u00e5pnet i Credoveita i Trondheim i 1998. Februar 2018 gjen\\u00e5pner vi p\\u00e5 Lilleby i nye lokaler. &nbsp;<\\/p>\",\"3\":{\"84\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"57\"],\"standardBodyText\":\"<p>Credo \\u00f8nsker \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert, fra dag til dag. Vi setter ogs\\u00e5 sammen en drikkemeny som p\\u00e5 beste mulige m\\u00e5te komplementerer og l\\u00f8fter frem hver enkelt rett. Har du spesielle \\u00f8nsker kan du gjerne bestille fra v\\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<\\/p>\",\"settingImagePosition\":\"left\"}},\"85\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"54\"]}},\"86\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"En liten mellomtittel\",\"standardBodyText\":\"<p>Credo \\u00f8nsker \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er. Menyen er basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert, fra dag til dag. Vi setter ogs\\u00e5 sammen en drikkemeny som p\\u00e5 beste mulige m\\u00e5te komplementerer og l\\u00f8fter frem hver enkelt rett. Har du spesielle \\u00f8nsker kan du gjerne bestille fra v\\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<\\/p>\"}},\"87\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Vegen videre\",\"standardImages\":[\"79\"],\"standardBodyText\":\"<p>R\\u00e5varene er motivasjonen v\\u00e5r. Hvorfor skulle vi ellers betale 260 kroner per kilo sm\\u00f8r? Med rent h\\u00e5ndverk kan vi som kokker utfolde oss med en oppmerksomhet rettet utad, p\\u00e5 gjesten som en del av et system. Vi tror at ethvert komponent er gjeldende - dyrene, skogen, jorden, m\\u00e5nen, sj\\u00f8en, kroppen.<br><\\/p>\"}}},\"16\":\"\"}}', '2017-12-17 13:35:05', '2017-12-17 13:35:05', '2b15e0df-a96b-4f18-bc3e-1b060ff3b307'),
 ('155', '20', '4', '49', 'no', '4', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Om oss\",\"slug\":\"om-oss\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"9\",\"fields\":{\"3\":{\"144\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Jossa\",\"standardImages\":[\"148\"],\"standardBodyText\":\"<p>P\\u00e5 midten av 1900-tallet bodde det en nysgjerrig, uj\\u00e5lete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne n\\u00e6rmest, hadde hun en umettelig utfartstrang i verden. <em>Hva trigget henne?<\\/em> Vi tror det var jakten p\\u00e5 de rene smakene. Og mat som ingen hun kjente hadde h\\u00f8rt om f\\u00f8r. Rettene m\\u00e5tte ha jordn\\u00e6r betydning for \\u00e5 smake det lille ekstra, i f\\u00f8lge Jossa. Hun \\u00f8nsket \\u00e5 forst\\u00e5 seg p\\u00e5 verden gjennom mat. Vi er derfor veldig glad og takknemlig for \\u00e5 f\\u00e5 fortsette historiene hennes videre, gjennom Jossa mat og drikke her i Credoveita.<br><\\/p>\"}},\"145\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Vi \\u00e5pner i starten av 2018, s\\u00e5 meld deg p\\u00e5 nyhetsbrevet v\\u00e5rt for \\u00e5 motta oppdateringer.\",\"standardBodyText\":\"\"}}}}}', '2017-12-17 13:40:05', '2017-12-17 13:40:05', 'efb1c360-1e5e-4332-9d14-3b5626bba1d3'),
 ('156', '20', '4', '49', 'no', '5', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Om oss\",\"slug\":\"om-oss\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"9\",\"fields\":{\"3\":{\"144\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Jossa\",\"standardImages\":[\"148\"],\"standardBodyText\":\"<p>P\\u00e5 midten av 1900-tallet bodde det en nysgjerrig, uj\\u00e5lete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne n\\u00e6rmest, hadde hun en umettelig utfartstrang i verden. <em>Hva trigget henne?<\\/em> Vi tror det var jakten p\\u00e5 de rene smakene. Og mat som ingen hun kjente hadde h\\u00f8rt om f\\u00f8r. Rettene m\\u00e5tte ha jordn\\u00e6r betydning for \\u00e5 smake det lille ekstra, i f\\u00f8lge Jossa. Hun \\u00f8nsket \\u00e5 forst\\u00e5 seg p\\u00e5 verden gjennom mat. Vi er derfor veldig glad og takknemlig for \\u00e5 f\\u00e5 fortsette historiene hennes videre, gjennom Jossa mat og drikke her i Credoveita.<br><\\/p>\"}},\"145\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Vi \\u00e5pner i starten av 2018, s\\u00e5 meld deg p\\u00e5 nyhetsbrevet v\\u00e5rt for \\u00e5 motta oppdateringer.\",\"standardBodyText\":\"\"}}}}}', '2017-12-17 19:00:21', '2017-12-17 19:00:21', '5cec67fd-6d1e-4257-a8a6-4590a3ec269f'),
 ('157', '12', '4', '49', 'no', '3', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Om oss\",\"slug\":\"om-oss\",\"postDate\":1505469300,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"8\",\"fields\":{\"3\":{\"new0\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Finnes Kaf\\u00e9\",\"standardImages\":[\"149\"],\"standardBodyText\":\"<p>Innkvartert i Lillebys historiske gamle barnehjem er Finnes Kafe det siste kulinariske tillegget til Heidi Bjerkans voksende spisestue.<\\/p>\"}},\"53\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"122\"],\"standardBodyText\":\"<p>En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus p\\u00e5 menneskene som maten, b\\u00f8ndene og dyrene, med kj\\u00f8tt og fisk tilberedt i samme m\\u00e5l, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbr\\u00f8d, andebryst, stekte torskehoder og rabarbraslush.<\\/p>\",\"settingImagePosition\":\"left\"}},\"new1\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Historien\",\"standardBodyText\":\"<p>En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus p\\u00e5 menneskene som maten, b\\u00f8ndene og dyrene, med kj\\u00f8tt og fisk tilberedt i samme m\\u00e5l, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbr\\u00f8d, andebryst, stekte torskehoder og rabarbraslush.<\\/p>\"}},\"new2\":{\"modified\":\"1\",\"type\":\"image\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"150\"]}},\"new3\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"152\"],\"standardBodyText\":\"<p>Tekst om Heidi&nbsp;En raffinert men avslappet kafe - Finnes er et sted som tilbyr en meny med like stort fokus p\\u00e5 menneskene som maten, b\\u00f8ndene og dyrene, med kj\\u00f8tt og fisk tilberedt i samme m\\u00e5l, mening og over samme kullgrill som Credo. Tenk lakrismuffins, surdeigsbr\\u00f8d, andebryst, stekte torskehoder og rabarbraslush.<\\/p>\",\"settingImagePosition\":\"right\"}}}}}', '2017-12-17 19:27:46', '2017-12-17 19:27:46', '8b5bf8b8-87d9-4832-9ec3-f9dd15ed031a'),
