 ('349', '300', '3', '66', 'no', '3', '', '{\"typeId\":\"3\",\"authorId\":\"66\",\"title\":\"Jossa til Korea\",\"slug\":\"jossa-til-korea\",\"postDate\":1534268700,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"299\"],\"10\":\"\",\"3\":{\"301\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Etter en lengre pause fra kj\\u00f8kkenet og en st\\u00f8rre mengde norkse tradisjoner som sild, torsk og akevitt etter \\u00e5pning av et nytt kj\\u00f8kken p\\u00e5 Lilleby, er Jossa sin eventyrlyst tilbake for fullt.<\\/p>\\r\\n<p>Sekken har v\\u00e6rt pakket og klar i lang tid, og endelig er ogs\\u00e5&nbsp;Jossa klar til \\u00e5 vende&nbsp;snuten i en retning av mer spicy smaker i Asia og n\\u00e6rmere Korea.<\\/p>\\r\\n<p>Vel fremme i Korea, og med kimchi, gochujang, tofu og grillet kj\\u00f8tt i tankene f\\u00e5r Jossa vann i munnen. Men aller f\\u00f8rst - Spicy Koreansk Ramen!&nbsp;<\\/p>\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Jossa til Korea\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"299\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-14 17:59:01', '2018-08-14 17:59:01', '1dd9e94e-7f36-4e26-9754-992cfc58aa66'),
 ('350', '16', '4', '66', 'no', '23', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Om oss\",\"slug\":\"om-oss\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"102\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Credos hjerte ligger der r\\u00e5varene produseres.\",\"standardImages\":[\"175\"],\"standardBodyText\":\"<p>P\\u00e5 Credo skal du f\\u00e5 mat laget p\\u00e5 r\\u00e5varer dyrket i regionen, fisket i havet utenfor, og meieriprodukter kultivert p\\u00e5 m\\u00e5ter der smak og b\\u00e6rekraft er viktige elementer.<br><\\/p>\",\"settingTextWhiteBox\":\"1\"}},\"289\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"79\"],\"standardBodyText\":\"<p>Det viktigste her p\\u00e5 Credo er r\\u00e5varene. N\\u00e5r vi snakker om smak, s\\u00e5 tenker vi p\\u00e5 muligheten en r\\u00e5vare gir. Hva smaker en gulrot, hva smaker denne gulroten? Hvordan kan vi bruke den, og hvordan endrer smaken seg over tid? Kan den fermenteres, kan den r\\u00f8ykes, eller skal vi gj\\u00f8re begge deler?&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}},\"104\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"159\"],\"standardBodyText\":\"<p>P\\u00e5 Credo er vi underordnet den opprinnelig smak, smakene som er stedsbestemt. Vi trenger tilgang p\\u00e5 de beste r\\u00e5varene, og&nbsp;derfor leter vi etter smaker, smaken som kommer fra en g\\u00e5rd, en g\\u00e5rdbruker eller et jordsmonn, for&nbsp;det er de sm\\u00e5 forskjellene som gir de gode r\\u00e5varene.&nbsp;<\\/p>\\r\\n<p>Credo \\u00f8nsker \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er, og dermed er&nbsp;menyen basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert, fra dag til dag.&nbsp;<\\/p>\",\"settingImagePosition\":\"right\"}},\"106\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"292\"],\"standardBodyText\":\"<p>Med n\\u00e6r kontakt til produsentene v\\u00e5re og med en etisk tiln\\u00e6rming til det vi gj\\u00f8r, s\\u00f8ker vi kontinuerlig utvikling mot b\\u00e6rekraft, da vi&nbsp;tror p\\u00e5 at det gjenspeiler seg i smak.&nbsp;R\\u00e5varene er motivasjonen, og&nbsp;med rent h\\u00e5ndverk kan vi utfolde oss med en oppmerksomhet rettet utad. Vi tror at enhver komponent er gjeldende - dyrene, skogen, jorden, m\\u00e5nen, sj\\u00f8en og kroppen.<\\/p>\\r\\n<p>P\\u00e5 Credo feirer vi dette mangfoldet. Vi feirer h\\u00f8ydementer, t\\u00e5ke, sol og regn i st\\u00f8rre og mindre mengder. P\\u00e5 Credo feirer vi smaken av stedet.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Om oss\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Om oss\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2018-08-14 20:16:48', '2018-08-14 20:16:48', '75c567de-823e-49bc-8857-d16a9a5898af'),
 ('351', '22', '4', '66', 'no', '7', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Karriere\",\"slug\":\"kontakt\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"9\",\"fields\":{\"3\":{\"185\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Karriere\",\"standardImages\":[\"82\"],\"standardBodyText\":\"<p>Vi er alltid p\\u00e5 utkikk etter nye, engasjerte ansatte som \\u00f8nsker \\u00e5 bli en del av Credo-familien.<\\/p>\\r\\n<p>Hvis du \\u00f8nsker \\u00e5 s\\u00f8ke en stilling eller har noen sp\\u00f8rsm\\u00e5l, ta kontakt p\\u00e5:&nbsp;<a href=\\\"mailto:credo@restaurantcredo.no\\\" class=\\\"link\\\">credo@restaurantcredo.no<\\/a><\\/p>\\r\\n<p><a href=\\\"mailto:credo@restaurantcredo.no\\\" class=\\\"link\\\"><\\/a><\\/p>\",\"settingTextWhiteBox\":\"1\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Karriere\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Karriere\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2018-08-14 20:38:47', '2018-08-14 20:38:47', 'f8b7929e-aae6-4024-a63a-3c4fcb446423'),
 ('352', '300', '3', '66', 'no', '4', '', '{\"typeId\":\"3\",\"authorId\":\"66\",\"title\":\"Jossa til Korea\",\"slug\":\"jossa-til-korea\",\"postDate\":1534268700,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"299\"],\"10\":\"\",\"3\":{\"301\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Etter en lengre pause fra kj\\u00f8kkenet og en st\\u00f8rre mengde norkse tradisjoner som sild, torsk og akevitt etter \\u00e5pning av et nytt kj\\u00f8kken p\\u00e5 Lilleby, er Jossa sin eventyrlyst tilbake for fullt.<\\/p>\\r\\n<p>Sekken har v\\u00e6rt pakket og klar i lang tid, og endelig er ogs\\u00e5&nbsp;Jossa klar til \\u00e5 vende&nbsp;snuten i en retning av mer spicy smaker i Asia og n\\u00e6rmere Korea.<\\/p>\\r\\n<p>Vel fremme i Korea, og med kimchi, gochujang, tofu og grillet kj\\u00f8tt i tankene f\\u00e5r Jossa vann i munnen. Men aller f\\u00f8rst - Spicy Koreansk Ramen!&nbsp;<\\/p>\"}},\"new3\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"306\"],\"standardBodyText\":\"\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Jossa til Korea\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"299\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\