 ('353', '300', '3', '50', 'no', '5', '', '{\"typeId\":\"3\",\"authorId\":\"66\",\"title\":\"Jossa til Korea\",\"slug\":\"jossa-til-korea\",\"postDate\":1534268700,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"299\"],\"10\":\"\",\"3\":{\"301\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Etter en lengre pause fra kj\\u00f8kkenet og en st\\u00f8rre mengde norkse tradisjoner som sild, torsk og akevitt etter \\u00e5pning av et nytt kj\\u00f8kken p\\u00e5 Lilleby, er Jossa sin eventyrlyst tilbake for fullt.&nbsp;<\\/p>\\r\\n<p>Sekken har v\\u00e6rt pakket og klar i lang tid, og endelig er ogs\\u00e5&nbsp;Jossa klar til \\u00e5 vende&nbsp;snuten i en retning av mer spicy smaker i Asia og n\\u00e6rmere Korea.<\\/p>\\r\\n<p>Vel fremme i Korea, og med kimchi, gochujang, tofu og grillet kj\\u00f8tt i tankene f\\u00e5r Jossa vann i munnen. Men aller f\\u00f8rst - Spicy Koreansk Ramen!&nbsp;<\\/p>\"}},\"308\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"306\"],\"standardBodyText\":\"\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Jossa til Korea\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"299\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTrans