 ('375', '55', '3', '50', 'no', '3', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Ramen p\\u00e5 Finnes torsdag 21. september\",\"slug\":\"ramen-pa-finnes-torsdag-21-september\",\"postDate\":1505988840,\"expiryDate\":null,\"enabled\":0,\"parentId\":null,\"fields\":{\"17\":[\"5\"],\"4\":[\"54\"],\"10\":\"<p>Finnes Kaf\\u00e9 is serving Ramen again on the 21st of September, and this time we\'ll make sure that we have enough noodles to serve everyone who visits us!<br><\\/p>\",\"3\":{\"56\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Ramen will be served from 12PM - 8PM, and the price will be 150NOK. No reservation is needed and we are looking forward to welcome you all!<\\/p>\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Ramen p\\u00e5 Finnes torsdag 21. september\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Finnes Kaf\\u00e9 is serving Ramen again on the 21st of September, and this time we\'ll make sure that we have enough noodles to serve everyone who visits us!\\u00a0\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"54\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:45:30', '2018-08-15 09:45:30', '3efab6b1-888b-439b-8b5b-70fc8a7cf774'),
 ('376', '226', '3', '50', 'en', '1', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Fossan Br\\u00f8d\",\"slug\":\"fossan-brod\",\"postDate\":1515600180,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"5\"],\"4\":[\"224\"],\"10\":\"<p>Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.&nbsp;<\\/p>\",\"3\":{\"227\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Eng\",\"standardBodyText\":\"<p>Den ble til da selve turbinen m\\u00f8llen best\\u00e5r av, ble fraktet med jernbane til Hegra, og&nbsp;deretter med hest og vogn opp til Skjelstadmarka. I dag driftes Fossan M\\u00f8lle av Petter Fossan,&nbsp;og matmel blir fortsatt malt i denne gamle m\\u00f8lla. Finnes Kaf\\u00e9 \\u00f8nsker \\u00e5 sette lys p\\u00e5 denne gamle perlen, og til v\\u00e5r store begeistring f\\u00e5r vi oppdage melet i br\\u00f8dbaksten v\\u00e5r. Vi har utforsket med ulike melsorter fra Fossan M\\u00f8lle, og eksperimentene har resultert i et eget \\u201dFossan Br\\u00f8d\\u201d som er til salgs i kafeen!<\\/p>\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Fossan Br\\u00f8d\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"224\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:47:38', '2018-08-15 09:47:38', 'de0027a8-397c-4a88-8552-f930c4a28d18'),
 ('377', '226', '3', '50', 'en', '2', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Fossan Br\\u00f8d\",\"slug\":\"fossan-brod\",\"postDate\":1515600180,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"5\"],\"4\":[\"224\"],\"10\":\"<p>Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.&nbsp;<\\/p>\",\"3\":{\"227\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Den ble til da selve turbinen m\\u00f8llen best\\u00e5r av, ble fraktet med jernbane til Hegra, og&nbsp;deretter med hest og vogn opp til Skjelstadmarka. I dag driftes Fossan M\\u00f8lle av Petter Fossan,&nbsp;og matmel blir fortsatt malt i denne gamle m\\u00f8lla. Finnes Kaf\\u00e9 \\u00f8nsker \\u00e5 sette lys p\\u00e5 denne gamle perlen, og til v\\u00e5r store begeistring f\\u00e5r vi oppdage melet i br\\u00f8dbaksten v\\u00e5r. Vi har utforsket med ulike melsorter fra Fossan M\\u00f8lle, og eksperimentene har resultert i et eget \\u201dFossan Br\\u00f8d\\u201d som er til salgs i kafeen!<\\/p>\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Fossan Br\\u00f8d\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Fossan M\\u00f8lle er en perle av m\\u00f8lleverk fra 1936 lokalisert i Skjelstadmarka i Tr\\u00f8ndelag.\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"224\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 09:51:29', '2018-08-15 09:51:29', '831524f9-a556-4441-aeea-6b065bee5ee2'),
 ('378', '16', '4', '50', 'no', '24', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Om oss\",\"slug\":\"om-oss\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"102\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Credos hjerte ligger der r\\u00e5varene produseres.\",\"standardImages\":[\"175\"],\"standardBodyText\":\"<p>P\\u00e5 Credo skal du f\\u00e5 mat laget p\\u00e5 r\\u00e5varer dyrket i regionen, fisket i havet utenfor, og meieriprodukter kultivert p\\u00e5 m\\u00e5ter der smak og b\\u00e6rekraft er viktige elementer.<br><\\/p>\",\"settingTextWhiteBox\":\"1\"}},\"289\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"79\"],\"standardBodyText\":\"<p>Det viktigste her p\\u00e5 Credo er r\\u00e5varene. N\\u00e5r vi snakker om smak, s\\u00e5 tenker vi p\\u00e5 muligheten en r\\u00e5vare gir. Hva smaker en gulrot, hva smaker denne gulroten? Hvordan kan vi bruke den, og hvordan endrer smaken seg over tid? Kan den fermenteres, kan den r\\u00f8ykes, eller skal vi gj\\u00f8re begge deler?<\\/p>\",\"settingImagePosition\":\"left\"}},\"104\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"159\"],\"standardBodyText\":\"<p>P\\u00e5 Credo er vi underordnet den opprinnelig smak, smakene som er stedsbestemt. Vi trenger tilgang p\\u00e5 de beste r\\u00e5varene, og&nbsp;derfor leter vi etter smaker, smaken som kommer fra en g\\u00e5rd, en g\\u00e5rdbruker eller et jordsmonn, for&nbsp;det er de sm\\u00e5 forskjellene som gir de gode r\\u00e5varene.&nbsp;<\\/p>\\r\\n<p>Credo \\u00f8nsker \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i og til stedet vi er, og dermed er&nbsp;menyen basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert, fra dag til dag.&nbsp;<\\/p>\",\"settingImagePosition\":\"right\"}},\"106\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"292\"],\"standardBodyText\":\"<p>Med n\\u00e6r kontakt til produsentene v\\u00e5re og med en etisk tiln\\u00e6rming til det vi gj\\u00f8r, s\\u00f8ker vi kontinuerlig utvikling mot b\\u00e6rekraft, da vi&nbsp;tror p\\u00e5 at det gjenspeiler seg i smak.&nbsp;R\\u00e5varene er motivasjonen, og&nbsp;med rent h\\u00e5ndverk kan vi utfolde oss med en oppmerksomhet rettet utad. Vi tror at enhver komponent er gjeldende - dyrene, skogen, jorden, m\\u00e5nen, sj\\u00f8en og kroppen.<\\/p>\\r\\n<p>P\\u00e5 Credo feirer vi dette mangfoldet. Vi feirer h\\u00f8ydementer, t\\u00e5ke, sol og regn i st\\u00f8rre og mindre mengder. P\\u00e5 Credo feirer vi smaken av stedet.&nbsp;<\\/p>\",\"settingImagePosition\":\"left\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Om oss\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Om oss\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2018-08-15 09:58:39', '2018-08-15 09:58:39', 'fa284bb8-3361-4b2e-b99f-db4b984812be'),
 ('379', '69', '4', '50', 'no', '19', '', '{\"typeId\":\"4\",\"authorId\":\"66\",\"title\":\"Meny\",\"slug\":\"meny\",\"postDate\":1506234240,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"117\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Meny\",\"standardImages\":[\"96\"],\"standardBodyText\":\"<p>Credo meny - 1300,-&nbsp;<br><\\/p>\\r\\n<p>Vinpakke - 1200,-<\\/p>\",\"settingTextWhiteBox\":\"1\"}},\"294\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"160\"],\"standardBodyText\":\"<p>P\\u00e5 Credo \\u00f8nsker vi \\u00e5 ta deg gjennom flerfoldige smaker, teksturer og f\\u00f8lelser. Vi \\u00f8nsker \\u00e5 vise deg det beste fra g\\u00e5rdene v\\u00e5re, fra dyrene deres, fra jorda og fra havet. Vi bruker tid p\\u00e5 \\u00e5 finne r\\u00e5varer som best viser egenskapene til tiden vi er i, og til stedet vi er p\\u00e5.<\\/p>\\r\\n<p>Menyen er satt og best\\u00e5r av mellom 20-25 serveringer. Den endres hver eneste dag, da den&nbsp;er basert p\\u00e5 det mest interessante og beste vi f\\u00e5r levert fra v\\u00e5re leverand\\u00f8rer.<\\/p>\",\"settingImagePosition\":\"left\"}},\"295\":{\"modified\":\"1\",\"type\":\"imageWithText\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"293\"],\"standardBodyText\":\"<p>Vi setter ogs\\u00e5 sammen en drikkemeny som p\\u00e5 beste mulige m\\u00e5te komplementerer og l\\u00f8fter frem hver enkelt rett. Drikkemenyen best\\u00e5r av b\\u00e5de \\u00f8l, cider og et utvalg av viner, og ogs\\u00e5 denne endres daglig. Har du spesielle \\u00f8nsker kan du gjerne bestille fra v\\u00e5r rikholdige vinkjeller best\\u00e5ende av flere tusen viner.<\\/p>\",\"settingImagePosition\":\"right\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Meny\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Meny\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2018-08-15 09:59:06', '2018-08-15 09:59:06', '5b7fc10f-53fb-4746-8d20-2e6111a83157'),
