 ('382', '17', '4', '50', 'no', '16', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Karriere\",\"slug\":\"kontakt\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"7\",\"fields\":{\"3\":{\"74\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Karriere\",\"standardImages\":[\"82\"],\"standardBodyText\":\"<p>Vi er alltid p\\u00e5 utkikk etter nye, engasjerte ansatte som \\u00f8nsker \\u00e5 bli en del av Credo-familien.<\\/p>\\r\\n<p>Hvis du \\u00f8nsker \\u00e5 s\\u00f8ke en stilling eller har noen sp\\u00f8rsm\\u00e5l, ta kontakt p\\u00e5:&nbsp;<a href=\\\"mailto:credo@restaurantcredo.no\\\" class=\\\"link\\\">credo@restaurantcredo.no<\\/a>&nbsp;<\\/p>\",\"settingTextWhiteBox\":\"1\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Karriere\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Karriere\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2018-08-15 10:00:57', '2018-08-15 10:00:57', '75575632-f631-4ad5-bee8-d9ae3d4ee68d'),
 ('383', '20', '4', '50', 'no', '9', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Om oss\",\"slug\":\"om-oss\",\"postDate\":1505469360,\"expiryDate\":null,\"enabled\":0,\"parentId\":\"9\",\"fields\":{\"3\":{\"144\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Jossa\",\"standardImages\":[\"148\"],\"standardBodyText\":\"<p>P\\u00e5 midten av 1900-tallet bodde det en nysgjerrig, uj\\u00e5lete og raus dame i Credoveita; Josefine Halvorsen. Selv om Trondheim sto hjertet henne n\\u00e6rmest, hadde hun en umettelig utfartstrang i verden. <em>Hva trigget henne?<\\/em> Vi tror det var jakten p\\u00e5 de rene smakene. Og mat som ingen hun kjente hadde h\\u00f8rt om f\\u00f8r. Rettene m\\u00e5tte ha jordn\\u00e6r betydning for \\u00e5 smake det lille ekstra, i f\\u00f8lge Jossa. Hun \\u00f8nsket \\u00e5 forst\\u00e5 seg p\\u00e5 verden gjennom mat. Vi er derfor veldig glad og takknemlig for \\u00e5 f\\u00e5 fortsette historiene hennes videre, gjennom Jossa mat og drikke her i Credoveita.&nbsp;<br><\\/p>\",\"settingTextWhiteBox\":\"\"}},\"145\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Vi \\u00e5pner i starten av 2018, s\\u00e5 meld deg p\\u00e5 nyhetsbrevet v\\u00e5rt for \\u00e5 motta oppdateringer.\",\"standardBodyText\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Om oss\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImag