 ('391', '7', '4', '50', 'no', '91', '', '{\"typeId\":\"4\",\"authorId\":\"1\",\"title\":\"Credo \",\"slug\":\"restaurant\",\"postDate\":1505469180,\"expiryDate\":null,\"enabled\":1,\"parentId\":\"\",\"fields\":{\"3\":{\"97\":{\"modified\":\"1\",\"type\":\"imageFullWidth\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"Kj\\u00e6rlighet til r\\u00e5varen\",\"standardImages\":[\"238\"],\"standardBodyText\":\"<p>Credo er en r\\u00e5vare-drevet restaurant som \\u00e5pnet i Credoveita i Trondheim i 1998.&nbsp;I 2018 flyttet&nbsp;vi til nye lokaler p\\u00e5&nbsp;Lilleby.<\\/p>\",\"settingTextWhiteBox\":\"\"}},\"80\":{\"modified\":\"1\",\"type\":\"introBoxes\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"standardImages\":[\"131\",\"130\"],\"standardHeading\":\"Kj\\u00e6rlighet til r\\u00e5varen\",\"standardBodyText\":\"<p>Credo er en r\\u00e5vare-drevet restaurant som \\u00e5pnet i Credoveita i Trondheim i 1998. Februar 2018 gjen\\u00e5pner vi p\\u00e5 Lilleby i nye lokaler. &nbsp;<\\/p>\"}},\"60\":{\"modified\":\"1\",\"type\":\"introLinks\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"customIntroLinks\":{\"76\":{\"type\":\"link\",\"enabled\":\"1\",\"fields\":{\"navn\":\"Historier fra Credo\",\"internLink\":\"\",\"externalLink\":\"http:\\/\\/credo.skogen.io\\/restaurant\\/journal\"}},\"77\":{\"type\":\"link\",\"enabled\":\"1\",\"fields\":{\"navn\":\"L\\u00e6r om v\\u00e5r filosofi\",\"internLink\":[\"16\"],\"externalLink\":\"\"}}}}},\"62\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"0\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"83\"],\"settingImagePosition\":\"right\",\"settingTextOverImage\":\"\"}},\"173\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"171\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}},\"123\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"90\"],\"settingImagePosition\":\"right\",\"settingTextOverImage\":\"\"}},\"124\":{\"modified\":\"1\",\"type\":\"journal\",\"enabled\":\"1\",\"collapsed\":\"1\",\"level\":\"0\",\"fields\":{\"customChooseJournal\":[\"94\"],\"settingImagePosition\":\"left\",\"settingTextOverImage\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Credo\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"title\",\"seoDescriptionUnparsed\":\"Credo\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageId\":\"\",\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"1\",\"18\":\"1\"}}', '2018-08-15 10:15:28', '2018-08-15 10:15:28', 'ae2230d6-bdda-4aa2-8d8a-34d906f9cac3'),
 ('392', '189', '3', '66', 'no', '3', '', '{\"typeId\":\"3\",\"authorId\":\"49\",\"title\":\"Jossa til \\u00d8sterrike\",\"slug\":\"jossa-til-osterike\",\"postDate\":1515593220,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"17\":[\"6\"],\"4\":[\"188\"],\"10\":\"<p>Jossa st\\u00e5r p\\u00e5 stasjonen med sekken full av tj\\u00e6repastiller og kandisert angelicastang, en god porsjon med isterban, en falukorv og en limpa.&nbsp;<\\/p>\",\"3\":{\"190\":{\"modified\":\"1\",\"type\":\"text\",\"enabled\":\"1\",\"collapsed\":\"0\",\"level\":\"0\",\"fields\":{\"standardHeading\":\"\",\"standardBodyText\":\"<p>Tobias har sagt farvel for kort tid siden. Han takket for selskapet, ga henne en god klem og trykket en gave ned i sekken. \\u2013 Du m\\u00e5 ikke \\u00e5pne den pakken f\\u00f8r du er fremme. Tobias s\\u00e5 p\\u00e5 Jossa og smilte.\\r\\n\\u2013 God tur, og hils til Werner.<\\/p>\\r\\n<p>Jossa klatrer om bord i toget og finner kupeen sin. Nattoget til malm\\u00f8, en behagelig m\\u00e5te \\u00e5 reise p\\u00e5, og fra Malm\\u00f8 er det ikke langt til kontinentet. Hun bryter av skalken p\\u00e5 br\\u00f8det og legger seg p\\u00e5 den oppredde senga. F\\u00f8ttene er m\\u00f8re etter all vandringen.&nbsp;Hun forsvinner inn i s\\u00f8vnen samtidig med togets startende bevegelser. Som et barn blir hun dysset i s\\u00f8vn, f\\u00f8r hun selv hadde tenkt. Det er m\\u00f8rkt, varmt og behagelig.<\\/p>\\r\\n<p>Det spraker i en h\\u00f8yttaler, plinger i en bjelle og det bankes p\\u00e5 d\\u00f8ren. Det f\\u00f8les som om det er samtidig, men hun tar det p\\u00e5 oppv\\u00e5kingsfasen, at hun har duppet av mellom lydene, bare fortrengt det litt.\\r\\nMalm\\u00f8, den kom raskere enn hun trodde, hele byen ligger der, foran henne, flat som den er.\\r\\nHun har b\\u00f8rstet av seg smulene fra br\\u00f8dskalken, skiftet, tatt en kattevask og pr\\u00f8vd \\u00e5 legge h\\u00e5ret stramt slik det s\\u00f8mmer seg, f\\u00f8r hun gikk av toget.<\\/p>\\r\\n<p>B\\u00e5ten venter, b\\u00e5ten til kontinentet st\\u00e5r i havna, noen hundre meter bortenfor stasjonen.\\r\\nFra K\\u00f8benhavn ble det tog til wien, med bytte i m\\u00fcnchen, Jossa var utmattet men merket seg at K\\u00f8benhavn var en by hun skulle utforske, men da p\\u00e5 vei hjem.<\\/p>\\r\\n<p>Brosteinen og kumlokkene, de er fine. Jossa ser ned mens hun tusler ut av stasjonsbygget i Wien.\\r\\nMen jeg er sulten. Sier hun h\\u00f8yt til seg selv, s\\u00e5 den d\\u00f8sige mannen som sto rett ved siden av i sin egen verden skvetter til og ser p\\u00e5 henne.\\r\\n\\u2013 unnskyld, sier han.\\r\\n\\u00c5h, nei \\u2013 det var ikke meningen, men jeg er bare litt sulten. Eller hvis jeg skal si det som sant er, jeg er skrubbsulten.\\r\\nHun hadde helt glemt \\u00e5 spise, helt glemt at hun var sulten n\\u00e5r hun l\\u00f8p fra b\\u00e5t til tog i K\\u00f8benhavn, og i M\\u00fcnchen ble det akkurat tid nok til en p\\u00f8lse med sauerkraut.\\r\\nHaha! Mannen smiler til, det glimter i gull bakerst i munnen\\r\\n\\u2013 Du har kommet til rett sted. Kom bli med meg.\\r\\n-Unnskyld, jeg glemte meg helt bort. Hvor er mine manerer, uff , Werner heter jeg fr\\u00f8ken. &nbsp;Han strekker ut en h\\u00e5nd. Jossa griper den og kjenner det faste h\\u00e5ndtrykket. Jossa sier hun, og smiler.<\\/p>\\r\\n<p>De n\\u00e6rmest sm\\u00e5l\\u00f8per innover byen. Jossa klarer ikke f\\u00e5 med seg noe, hun tenker bare p\\u00e5 mat.\\r\\n\\u2013 Hva skal du her i Wien ?\\r\\n\\u2013 Jeg skal spise, jeg vil smake det som er \\u00f8sterisk. Det er det som er reisen min skj\\u00f8nner du, jeg vil finne ut av hva ting smaker p\\u00e5 forskjellige steder.\\r\\nWerner stopper litt, mens han tenker.\\r\\n\\u2013 S\\u00e5 du vil smake det som er mest Wiensk, ok, men da tar vi til h\\u00f8yre her.\\r\\nDu skal f\\u00e5 Sp\\u00e4tzle, og det er best p\\u00e5 et bitte lite sted rett her borte.<\\/p>\\r\\n<p>De sm\\u00e5l\\u00f8per videre, litt uten grunn, men drevet av sult og nysgjerrighet.&nbsp;Sp\\u00e4tzle, en slags urpasta, eller gnocchi, eller en blanding av de begge.&nbsp;N\\u00e5r Werner forteller om smaken, den smeltede osten og ikke minst vinen som skal drikkes til g\\u00e5r det nesten rundt for Jossa.<\\/p>\\r\\n<p>Endelig skal hun f\\u00e5 mat.\\r\\nWerner dumper ned i stolen ved siden av henne.\\r\\n\\u2013 S\\u00e5nn, vin og mat p\\u00e5 vei. Du er skikkelig sulten ? Jossa klarer knapt \\u00e5 ytre ja, hun venter bare p\\u00e5 noe \\u00e5 spise.\\r\\n\\u2013 Jeg bestillte litt forskjellig, s\\u00e5 du skal f\\u00e5 et raskt overblikk, det blir kanskje litt mye. Men det kommer noen andre venner av meg ogs\\u00e5, som kan mer om vin, s\\u00e5 da spiser han det vi ikke klarer. Ok? Werner har tatt kommandoen og ser ut til \\u00e5 kose seg i rollen som vertskap. \\u2013 Grillet kalvetunge med syltede gr\\u00f8nnsaker, Sp\\u00e4tzle med sopp og ost, Gresskarsuppe med krepse-dumplings, P\\u00f8lse med sauerkraut, Snitzel med potetsalat og sitron, R\\u00f8ye med k\\u00e5l, og til dessert f\\u00e5r du Schwartswaldkake med kirseb\\u00e6r ogs\\u00e5 kan du ikke unng\\u00e5 strudelen da. Den m\\u00e5 du smake n\\u00e5r du er i Wien .\\r\\nJossa rister p\\u00e5 hodet og ler.\\r\\n\\u2013 Jeg klarer jo ikke alt sammen, det er jo umulig.<\\/p>\",\"settingAlignCenter\":\"\"}}},\"21\":{\"seoMainEntityCategory\":\"CreativeWork\",\"seoMainEntityOfPage\":\"WebPage\",\"seoTitleSource\":\"field\",\"seoTitleSourceField\":\"title\",\"seoTitleUnparsed\":\"Jossa til \\u00d8sterike\",\"seoDescriptionSource\":\"field\",\"seoDescriptionSourceField\":\"standardLeadText\",\"seoDescriptionUnparsed\":\"Jossa st\\u00e5r p\\u00e5 stasjonen med sekken full av tj\\u00e6repastiller og kandisert angelicastang, en god porsjon med isterban, en falukorv og en limpa.\\u00a0\",\"seoKeywordsSource\":\"custom\",\"seoKeywordsSourceField\":\"title\",\"seoKeywordsUnparsed\":\"\",\"seoImageIdSource\":\"field\",\"seoImageIdSourceField\":\"standardImages\",\"seoImageId\":[\"188\"],\"seoImageTransform\":\"\",\"canonicalUrlOverride\":\"\",\"twitterCardType\":\"\",\"seoTwitterImageIdSource\":\"custom\",\"seoTwitterImageIdSourceField\":\"standardImages\",\"seoTwitterImageId\":\"\",\"seoTwitterImageTransform\":\"\",\"openGraphType\":\"\",\"seoFacebookImageIdSource\":\"custom\",\"seoFacebookImageIdSourceField\":\"standardImages\",\"seoFacebookImageId\":\"\",\"seoFacebookImageTransform\":\"\",\"robots\":\"\"},\"19\":\"\",\"18\":\"\",\"16\":\"\"}}', '2018-08-15 11:52:58', '2018-08-15 11:52:58', 'ed1b30d2-61f7-4a56-92c4-82eb8dbbe6a8'),
