r er mine manerer uff werner heter jeg froken han strekker ut en hand jossa griper den og kjenner det faste handtrykket jossa sier hun og smiler de naermest smaloper innover byen jossa klarer ikke fa med seg noe hun tenker bare pa mat hva skal du her i wien jeg skal spise jeg vil smake det som er osterisk det er det som er reisen min skjonner du jeg vil finne ut av hva ting smaker pa forskjellige steder werner stopper litt mens han tenker sa du vil smake det som er mest wiensk ok men da tar vi til hoyre her du skal fa spaetzle og det er best pa et bitte lite sted rett her borte de smaloper videre litt uten grunn men drevet av sult og nysgjerrighet spaetzle en slags urpasta eller gnocchi eller en blanding av de begge nar werner forteller om smaken den smeltede osten og ikke minst vinen som skal drikkes til gar det nesten rundt for jossa endelig skal hun fa mat werner dumper ned i stolen ved siden av henne sann vin og mat pa vei du er skikkelig sulten jossa klarer knapt a ytre ja hun venter bare pa noe a spise jeg bestillte litt forskjellig sa du skal fa et raskt overblikk det blir kanskje litt mye men det kommer noen andre venner av meg ogsa som kan mer om vin sa da spiser han det vi ikke klarer ok werner har tatt kommandoen og ser ut til a kose seg i rollen som vertskap grillet kalvetunge med syltede gronnsaker spaetzle med sopp og ost gresskarsuppe med krepse dumplings polse med sauerkraut snitzel med potetsalat og sitron roye med kal og til dessert far du schwartswaldkake med kirsebaer ogsa kan du ikke unnga strudelen da den ma du smake nar du er i wien jossa rister pa hodet og ler jeg klarer jo ikke alt sammen det er jo umulig '),
